INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (1, 1, 1869, 'Great outside speaker and alexa is really great to use.', 45, 13);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (2, 5, 1227, 'While I''ve purchased items from Amazon for years, I rarely write reviews. I felt compelled to write one because, although there are only a few reviews at this point, I have never seen such a good product get such bad reviews. I''m hoping as more people purchase these, the star rating will be more accurate of the product itself. I''ll address the three biggest complaints I''ve read from others:Sound Quality: I think these headphones sound great. I''ve never owned an expensive pair so I''m not able to compare them to higher-end offerings, but I''ve owned dozens of cheap and mid-range headphones in the 15-50 range. I''m not an audiophile or a musician so if I''m missing something that should be coming through, but isn''t, I''m fine with my ignorance. I would say they''re slightly better than Apple''s buds (which I liked very much and used for years, most recently using their redesigned ones for about a year). There''s no tinny, listening through a can sound that''s all-too-common with headphones in this price range. As far as people saying they don''t compare to Apple''s buds, well I don''t know, maybe they have some crazy exclusive version of Apple''s buds that are amazing. But compared to the regular earpods, I think Amazon''s headphones actually sound a bit better. They provide a nice, full sound and represent highs, lows and mids equally well (mainly listening to metal).Fit and Feel: Some people have complained about these falling, or feeling like they''re going to fall, out of their ears. There''s some validity to this, although obviously it depends on your specific ears. I don''t feel like they''re going to fall out at all, but if I give the cord a tug, they don''t stay as secure as my Apple buds.Read more', 31, 134);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (3, 2, 1721, 'A remote this small and black is begging to be lost. I knew it the day we bought it. Somehow my 8 yr old has lost it...someday it will surface but, in the meantime, how do I watch my shows DOWNLOAD THE FIRE TV REMOTE APP. Hey it worked! I have an Apple iPhone 5S and am happy to say the app does indeed work and control my Fire TV stick. Best of all - the app is FREE.', 286, 81);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (4, 5, 3810, 'I love this speaker it works wonderfully. Very recommend', 657, 455);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (5, 3, 200, 'This is a great cover. It turns the device on and off by opening and closing and works as a great stand with it either vertical or horizontal. It also adds very little to the size or weight of the tablet. I absolutely recommend it!', 114, 490);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (6, 5, 3872, 'So far, this is doing what I wanted it to. I purchased it for having Alex hear me from my bedroom and my dining room. At times when I am playing music louder or just wanting her to do a command, I have to repeat myself louder. I usually keep the remote in the bedroom to give her commands but I will move it when I have company and am sitting down to eat or with guests in living room. I can practically whisper the command using the remote whereas without it, I have to shout the command out to the other room. Also, did not find opening the back to insert batteries that difficult. Did take a few tries to pair it. I ended up replacing the batteries that were sent with Duracell', 664, 168);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (7, 2, 4423, 'I pre-ordered this for my wife mostly to use as a Kindle E-reader as I figured the tablet would be slow and the display would be less than impressive. I was wrong. What a bargain this little beauty is! This model cost 49.00 but it comes with ad''s displayed on the lock screen when your tablet is dormant. Once your screen times out, they disappear. You can pay 15.00 up front to get an ad free version so I assumed to unlock the tablet I''d have to spend 15 to 30 seconds looking at an ad for Amazon Prime, or a product from the daily specials section of Amazon.com I abstained from paying for Ad removal and was pleasantly surprised to find that the ads are only on the lock screen and that as soon as I unlock the tablet they disappear immediately.Here are my pros and cons thus far.PRO:Perfect size for Ebooks, and web surfing to alleviate strain on the eyes from my 5 phone displaynice sturdy casing that gives it a nice heft but still weighs in as one of the lighter tablets on the marketChild Accounts- Amazon allows you to set up this tablet with age restricted access for kids making this a low cost piece of tech that is perfect for school kids and allows mom and dad to ration the amount of time lil Johnny can play Clash of Clans and how much he can hit the ol'' Visa card for.Battery life thus far wife was on it for about 5 hours last night and battery was at about 46Kindle Integration -this goes without saying but having my ebooks and audible books synced to the tablet is awesome and my Kindle books look greatPrice - it''s a 50.Read more', 159, 437);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (8, 5, 6469, 'Extremely wonderful tablet, it definitely gets the job done adaptes very well with everyday usage, good speed, nice display, and one I would definitely recommend to everyone!', 456, 177);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (9, 1, 7357, 'Having received my Fire TV today, I''ve been trying it out for the past couple of hours.Setup was a no brainer. It required an update immediately so it did take about 15 minutes to have it in action but the process was very simple.The image quality (movies and games) is excellent. I''ve tried several movies from Amazon Prime and they look and sound nearly Blu Ray quality as far as I can tell.Navigation is very straightforward and it''s generally easy to find anything you''re looking for. Installation of games and apps goes very smoothly and generally pretty quickly.The remote works very well. I haven''t played with the voice search feature much yet, but when I have tried it, it worked well. The buttons on the remote are well thought out and I prefer it to the Apple TV remote.I only have one gripe. As far as I can tell, there''s no way to limit the list of movies and tv shows to what is available for Amazon Prime members. This makes it very inconvenient to find things that are free to watch. There are some categories that are limited to Prime (Most Popular on Prime, For Kids on Prime) I want to be able to just see what''s available for Prime or at least be able to see by category what''s available for Prime. I''m sure this isn''t an oversight. I suspect Amazon wants to force us to look at everything and be tempted to buy/rent things but if they really want to compete with Netflix, they''ll understand that we pay for our Prime membership to be able to watch free movies conveniently. A workaround is to do your searching on the web and then search specifically on the device.Perhaps I just haven''t found the way to search for Prime available content. I hope that''s the case or I will really be disappointed.Read more', 344, 131);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (20, 1, 2863, 'We got this for my son for xmas. He loves it. He uses it daily.', 475, 435);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (21, 4, 7110, 'Great speaker and Echo substitute. This is great for on the go as a Bluetooth speaker and when connected to the internet it works great using the Alexa app.', 779, 163);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (22, 3, 1446, 'Major fan, didn''t buy this because of protection, bought it cause it will blend in to my decor. It is not a skin, so it''s not skin tight. Yes it''s loose but how often will you grab it and move it. Me maybe once every year.', 953, 123);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (23, 1, 4304, 'Love it great speaker as long as u have access to WiFi', 384, 186);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (70, 2, 1326, 'The sound in this is on par with other high end portable speakers. That however is really just the tip of the iceberg. If you have amazon prime you can access all your music just by asking. Also this works if you have Phillips hue so you can turn the lights off and on with your voice.', 465, 225);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (10, 3, 3483, 'While I''ve purchased items from Amazon for years, I rarely write reviews. I felt compelled to write one because, although there are only a few reviews at this point, I have never seen such a good product get such bad reviews. I''m hoping as more people purchase these, the star rating will be more accurate of the product itself. I''ll address the three biggest complaints I''ve read from others:Sound Quality: I think these headphones sound great. I''ve never owned an expensive pair so I''m not able to compare them to higher-end offerings, but I''ve owned dozens of cheap and mid-range headphones in the 15-50 range. I''m not an audiophile or a musician so if I''m missing something that should be coming through, but isn''t, I''m fine with my ignorance. I would say they''re slightly better than Apple''s buds (which I liked very much and used for years, most recently using their redesigned ones for about a year). There''s no tinny, listening through a can sound that''s all-too-common with headphones in this price range. As far as people saying they don''t compare to Apple''s buds, well I don''t know, maybe they have some crazy exclusive version of Apple''s buds that are amazing. But compared to the regular earpods, I think Amazon''s headphones actually sound a bit better. They provide a nice, full sound and represent highs, lows and mids equally well (mainly listening to metal).Fit and Feel: Some people have complained about these falling, or feeling like they''re going to fall, out of their ears. There''s some validity to this, although obviously it depends on your specific ears. I don''t feel like they''re going to fall out at all, but if I give the cord a tug, they don''t stay as secure as my Apple buds.Read more', 436, 400);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (11, 2, 4692, 'If you read my Fire TV review you know that I am tough on Amazon when it comes to their own items. It needs to deliver quality for the price point to earn stars from me. Please take the time to read my entire review and feel free to ask questions. I will do my best to respond to them as I can and update the review to reflect those answers and other things I discover along the way.First my background. I own many Amazon Kindles (bw, Fire gen2, Fire gen3) as well as Apple Ipad (gen 4), Samsung Note 3 and have an LG G2 smartphone (had a Samsung S4 before that), notebooks, chromebooks, etc. I have also used many other products including the Fire HDX line. I have a solid computer background as well but honestly I am more of a casual user when it comes to tablets like this one.Amazon has changed many things over the life of the Fire product line. Adding and removing features (like cameras--the first generation had one but the second generation removed them but not they are back).They are all useful devices but each one has its own niche so to speak so make sure whatever you get has the features that are important to you.Now to this model. This is like a big smartphone--which is a big difference from past kindles. It is more compact, lighter and yet still very usable. In fact for me, the shrinking of size increases the usefulness. I find that I use my smartphone way more than my tablets--even the smaller Fire HD and Samsung Note tablets so I am expecting this to replace more of that on the couch usage which is great since it so much less expensive than most smartphones. That means you can feel less bad about scratches that might occur or the accidental drops. (I am guilty of both.Read more', 829, 58);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (12, 2, 6683, 'I was so shocked! So, I was going through a book for my PhD dissertation, highlighting parts for further citations in my project. When I was done with it, I realised that instead of scrolling back all the pages of my e-book, looking for the highlights, I can just export them to my e-mail in PDF file. This is life changing for me! I have always preferred paper books to e-books, but this option is a miracle. It saved me hours of work! I am a very happy customer!', 682, 206);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (13, 4, 5717, 'FireTV is basically just what it sounds like: it turns your TV into a giant Kindle Fire. If you are familiar with other streaming media players, youll have an idea of what to expect. FireTV streams video and audio content to your TV from the same providers: Hulu, Netflix, and (of course) Amazon.So lets go through my first experience:Part One: Opening the box (Queue Thus Sprach Zarathustra.)Ok, I have to say it: Nothing impressive here, sorry Amazon. I have to say that the FireTV is about the most boring looking black box Ive ever seen. The good news: It completely disappears on your entertainment center.The remote is pretty bare bones looking. The microphone button grabbed my attention, but otherwise, there are very few buttons. Can I complain that it is both very black and very small Yes, I know that Black is the new Black, but Ive already lost it once and Ive had it for about 2 hours.Ok, enough looky-looky, time to um.hooky-uppy.Part Two: Setup (Where is my That was Easy button)Power: CheckHDMI Cable: CheckTurn on TV: CheckWait for it to bootwaitIts done: Check (That was fast)And done Check Im an Amazon Prime member and my account was already setup on the box and ready to go.Part Three: Interface (What does this button do)Actually, its not rocket science:The Home button takes you back to the home screen.Click the wheel to scroll through options.Hit the button to make your selection.Voice Search: Ok, I will tell you: I am not a big user of voice tech. Really, I hate to use the telephone. I guess Im afraid the pizza guy is going to tell me No But I can see that with a little getting over my own fears, voice search is going to be awesome My FireTV correctly heard all three of my queries. One caveat here: Voice Search only pulls up Amazon content. No a huge deal for my family, but maybe for yours. You can always search the old fashioned way like other streaming boxes.Part Four: Video and AudioAs I said, it was easy to hook up. Just plug it in. Video looked great on my 40 TV. Audio was good over our home stereo. The quality did not seem any better or worse than my other HD set top box.The services available to stream from are also pretty standard fare both on the video and audio front.Part Five: Games (Thousands of games coming)This reminds me a bit of the days when I got the original Kindle Fire. Of course, Amazon made good on their promise there, so I have faith that theyll do the same here. Just a quick view through the list of already available games tells me that there is already a good mix of approved titles for the Fire TV, and more are on the horizon.Please do not mistake this for a NextGen gaming console. It looks like a good choice to be able to play tons of Android games on your big screen.Overall: 4 stars. Fire TV is a very nice mix of old and new. There are a few puzzle pieces missing, but knowing Amazon, theyll be filled in quickly', 457, 207);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (14, 1, 4151, 'If you''re reading reviews of the new 3rd generation Paperwhite, you''re likely considering buying one. If so, you''re probably in one of these categories:* Never owned a Kindle e-ink reader* Own an older Kindle e-ink reader, but not a Paperwhite* Own a first or second generation PaperwhiteI''ll save my opinion on whether the new Paperwhite 3 is worth buying until the end of my review. (But I will say this: They''ve taken a great product and made it even better.) First, here''s a comparison of the new Paperwhite with the second generation Paperwhite (comparisons are for the wi-fi models):Second Generation Paperwhite (2013)-------------------------------------------Size: 6.7x4.6x0.36Weight (wi-fi version): 7.3 ouncesDisplay: 6 diagonal, 212 pixels per inch, 16-level grayscale, LED frontlitStorage memory: 4GBPage turns: TouchscreenNumber of fonts: 6Display lighting: Manually adjustable front-lightingAll-New Paperwhite (2015)------------------------------Size: 6.7x4.6x0.36Weight (wi-fi version): 7.2 ouncesDisplay: 6 diagonal, 300 pixels per inch, 16-level grayscale, LED frontlitStorage memory: 4GBPage turns: TouchscreenNumber of fonts: 7Display lighting: Manually adjustable front-lightingNote that the physical size is identical to the older Paperwhite, so covers and sleeves that worked with the older Paperwhites are still usable (thank you, Amazon). The most obvious difference is the screen resolution: 300 pixels per inch is a major jump from the 212 pixels per inch in the older Paperwhites.Read more', 964, 450);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (15, 2, 806, 'It was excellent for me in one moment when I was able to use it onboard cruise ship while ship was in international water with it''s own 3G or EDGE cellphone network. Once they stop this way of using around 5 months ago, now I can use it only when I am in the states.', 355, 269);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (16, 5, 3331, 'I have the Echo and bought this one for the bedroom. Great alarm clock.', 986, 121);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (17, 5, 226, 'For the low price, this tablet really does more than expected! The camera isn''t great however, I always use my phone for a camera so that doesn''t effect me. Here are some of the pros and cons:Pros: Low cost yet high tech Great screen quality (of course there is better out there, but it looks great as is) Smooth and responsive Easy access to amazon prime content Easy to wirelessly share content to a TV Battery life Web browser works greatCons: Doesn''t have some apps android users are used to having Camera quality isn''t great and no flash Less ''extra features'' than some higher priced tablets haveI opted to go with the 16gb version with no ads. The ads aren''t a big deal, but I figured I would pass on having them on my screen. No matter what version you pick, they all do the same things. The gigs may or may not matter to you. 8 and 16 gigs both aren''t very large, but if you want to predownload some tv shows, movies, music before a vacation, then you may want to look into getting the larger 16gig. If you will always have internet connection, then it isn''t much a problem since you have unlimited cloud storage and can download to your device or stream at anytime you have internet.Overall... If you want an Amazon tablet, and you want the best, go with the HDX series. However, if you want an amazing tablet but don''t want to spend as much, then these new HD 6 7 series are great! For me and my uses, the HD 6 is the perfect fit.I would suggest the 6 over the 7 for most buyers. The only 2 things the 7 has over the 6, are a larger screen, and dual speakers. Sure the dual speakers is kind of nice, but the screen is actually lower quality than the 6.Read more', 341, 272);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (18, 4, 3063, 'First rate - high quality!', 888, 473);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (19, 5, 3195, 'We love this speaker for listening to music, the weather, news, or just anything. It is super portable and even has a hands-free option so it is really like a mini Echo!', 369, 40);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (24, 3, 7011, 'Updated 12/8/2014One year in...This review is for the the no-ad 64 GB wifi-only HDX 8.9.I use a Galaxy S5 Android smartphone so the HDX is for media / web surfing / offline viewing for travel. Since I had already been using Amazon Prime and Prime Music it was a no brainer for me to use the HDX to fill the role of media / web surfing on a tablet.Be informed about the download limitations to this device. Amazon has been adding clarification to this which should help would-be purchasers make a more informed opinion. This wasn''t as obvious as it should have been when I ordered mine so they''re listening which is good.Be aware that their most popular Prime content *may* not be available to download (and save) to your HDX. You can save certain videos to your HDX but you won''t know which ones until you buy an HDX and try it out. *** Edited 12/21/2013 You can now see a list of Prime movies and shows that can be downloaded to the device. That''s an improvement and more clearly shows the available downloadable Prime content. +1 for Amazon. ***I was also under the assumption that you could download as many videos as you''d like with the limiting factor being the memory capacity of the HDX. Also NOT the case. So again, I bought the larger capacity HDX under this assumption. That was dumb on my part as it turns out because you''re not limited by storage capacity. You''re limited the NUMBER of downloads you can have on your device. Kids'' content can be really short so you may find yourself running into that limitation, but most people never will.Read more', 698, 311);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (25, 3, 1573, 'I feel like a lot of the bad reviews are from people who do not know what they are doing, or don''t fully understand how to use the tablet to its full potential. This tablet DOES allow you download any app that you would find on the play store! Because of the parental features you have to first download them on YOUR PARENT PROFILE FIRST!! I love that about this tablet. Also, I can block the camera AND web browser so my child can''t access that either! I can put a pass code on pretty much everything like profiles, WiFi access, settings, etc. It''s really easy to set up and it came almost fully charged so I had plenty of time download what I wanted for my daughter and set it all up before I had to put it on the charger... It does, however, take a bit long to complete charge to 100, but no big deal. This is a great tablet so far and we are thoroughly enjoying it :)', 694, 240);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (26, 4, 1609, 'Bought it for a couple of my friends and it was a big hit with them! Very useful!', 188, 153);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (27, 4, 6636, 'would get another, works great, having fun with all the options', 853, 17);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (28, 1, 6806, 'I''m a long time Kindle user, and have upgraded a number of times. Every upgrade was a significant improvement, and the Oasis continues that trend. I love my Voyage, but the Oasis makes it feel like a hardback book. The pictures and descriptions don''t do the size and weight justice. Shockingly light, and small even with the case. Used without the case, it''s like holding a few sheets of paper. Amazing. Haven''t had it long enough to evaluate the battery life, but never had a problem with the previous models, so I assume the promise of much longer battery life (with the secondary battery in the case) is accurate.The balance in the hand without the case is stunningly good. With the case feels a bit like the Voyage (although quite a bit lighter than my Voyage in its case). Case is high quality and easy to put on and take off as needed. Screen seems a smidge clearer and higher definition than my Voyage (maybe due to the updated lighting system).I had the ''pressure sensitive'' page turner option on my Voyage turned off. Much too jumpy and sensitive, even at its ''hard'' setting. I won''t miss that. The new mechanical buttons on the Oasis are AWESOME. Nice upgrade there, and nice to not have to touch the screen for the most part.Yes, it is pricey. I would say if you are a ''few hour a week'' reader, the Paperwhite is your best bet (solid performance and very good price/value). But if you are a reading fanatic who reads a lot every day (like me!), the extra battery life and the balance/size/weight, along with the slightly improved screen is WELL worth the money, especially when spread over the life of the unit.Edit: A few more comments now that I''ve been using the Oasis for a number of months.Read more', 353, 200);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (29, 3, 3747, 'Exactly what it is supposed to be. Works great and I love the built-in light. Perfect reader, and very quick delivery.', 794, 298);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (30, 5, 5805, 'Well what to say This is a replacement remote, did I buy it due to one not working Nope the kids lost it and I wanted another till I could find it. Paring it was simple, hold the home button for around 10-15 seconds to let the fire stick find it and then Boom your all set to go!Works just like the original that came with it so no worries there.', 412, 46);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (31, 5, 8, 'An Amazon.com official commented on this review(What''s this) The Amazon team saysOctober 11, 2013Thank you for taking the time to share your feedback. We''re excited to see your encouraging comments regarding display and sound, and appreciate the thoughtful analysis you did of this device compared to the previous generation Kindle Fire and Kindle Fire HD. As you correctly point out, the new Kindle Fire HD is the successor to last year''s entry level Kindle Fire, which does not include features such as camera, microphone, or HDMI port. You are also correct to point out that this device does not support Mayday, although there are still multiple ways to get help for free directly from your device. We hope you enjoy the new features and services. Thanks, The Kindle Team', 800, 274);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (32, 2, 7415, 'An Amazon.com official commented on this review(What''s this) The Amazon team saysOctober 11, 2013Thank you for taking the time to share your feedback. We''re excited to see your encouraging comments regarding display and sound, and appreciate the thoughtful analysis you did of this device compared to the previous generation Kindle Fire and Kindle Fire HD. As you correctly point out, the new Kindle Fire HD is the successor to last year''s entry level Kindle Fire, which does not include features such as camera, microphone, or HDMI port. You are also correct to point out that this device does not support Mayday, although there are still multiple ways to get help for free directly from your device. We hope you enjoy the new features and services. Thanks, The Kindle Team', 454, 385);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (50, 2, 5332, 'Amazon Tap is exactly what I expected it would be. The sound quality is good with the Alexa features. I love that you can charge it on the base or with micro USB cord. I would recommend it to anyone that is interested in Amazon Echo and would like the portability.', 330, 377);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (51, 3, 4921, 'I''m still learning what all i can do with this device, but I am continually amazed at it''s capabilities. I love playing with it and learning from it. When doing other things, I have Tap playing music. I love this thing.', 701, 435);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (71, 3, 1488, 'I bought this about a month ago and I really like it. The best part is light in weight, sound is very good for small gathering like on the deck or camping and it comes with Batterey charger. The voice command activation is so great to have and listen all my music plus worldwide radios from TuneIn.', 625, 348);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (72, 1, 2937, 'It helps the kids with questions it plays any music you like .', 399, 26);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (33, 5, 5165, 'I''ll preface this by saying that I own an iPad, and was not expecting a 99 tablet to perform at anywhere near that level. I have followed the early reviews closely, and after seeing enough satisfied customers, I figured I''d give the Kindle Fire HD 6 a try. I chose the base 8 GB with special offers and my plan was to use it as a secondary e-reader and a secondary or even tertiary vehicle for internet access. What I''ve found is a powerful little tablet, so far completely free of the bugs and laggy speeds mentioned in the early reviews. In fact, performance has so exceeded expectations that I consider this perhaps the year''s best purchase.First off the look is nice. It''s sleek, (I ordered the black model) and though actually quite a bit heavier than I''d imagined, it''s not heavy enough to be considered a negative. The display is fantastic, and its quality was the first big surprise. The touch screen performs incredibly well, and to this point, I have experienced immediate response. To the point where I have to say touch response so far is indistinguishable from my iPad. Based on early reviews, this was not the case, so I have been quite pleasantly surprised. The Fire is very user friendly and easy to intuit. For those who do not feel confident with navigation of a new device, there is an immediate onscreen tutorial (with an option to skip) to guide you.I first checked out the e-reader function. My books loaded immediately and easily from the cloud and I really like the functionality of the reader.Read more', 352, 432);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (34, 3, 2809, 'Camera was perfect for my daughter... she''s in yearbook at school and fell in love with it...', 380, 260);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (35, 4, 4787, 'While I''ve purchased items from Amazon for years, I rarely write reviews. I felt compelled to write one because, although there are only a few reviews at this point, I have never seen such a good product get such bad reviews. I''m hoping as more people purchase these, the star rating will be more accurate of the product itself. I''ll address the three biggest complaints I''ve read from others:Sound Quality: I think these headphones sound great. I''ve never owned an expensive pair so I''m not able to compare them to higher-end offerings, but I''ve owned dozens of cheap and mid-range headphones in the 15-50 range. I''m not an audiophile or a musician so if I''m missing something that should be coming through, but isn''t, I''m fine with my ignorance. I would say they''re slightly better than Apple''s buds (which I liked very much and used for years, most recently using their redesigned ones for about a year). There''s no tinny, listening through a can sound that''s all-too-common with headphones in this price range. As far as people saying they don''t compare to Apple''s buds, well I don''t know, maybe they have some crazy exclusive version of Apple''s buds that are amazing. But compared to the regular earpods, I think Amazon''s headphones actually sound a bit better. They provide a nice, full sound and represent highs, lows and mids equally well (mainly listening to metal).Fit and Feel: Some people have complained about these falling, or feeling like they''re going to fall, out of their ears. There''s some validity to this, although obviously it depends on your specific ears. I don''t feel like they''re going to fall out at all, but if I give the cord a tug, they don''t stay as secure as my Apple buds.Read more', 38, 158);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (36, 5, 2196, 'Does as advertise. Good for bedroom and you can plug in external speakers.', 651, 398);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (37, 1, 888, 'I wouldn''t buy it again...the software doesn''t seem as well integrated with the hardware on this machine. I also have an Echo and I don''t have the same connectivity issues with it that I do with this. I liked the features available with this...portability mainly with a long battery life, but with plagued by connectivity issues I can''t say I would recommend it. I have looked at reviews online since purchasing and have discovered I am not the only one that feels this way. The sound, when it is connected and responding, is amazing.', 587, 185);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (38, 2, 6624, 'This is my 4th Kindle since I bought my first one as soon as Kindle was launched. With every new model, I was fascinated by the improvements and kept recommending them to friends. The Voyager was the first time I felt somewhat frustrated with an Amazon product.Yes, it is lighter and even easier to read than my previous models - if you are buying your first one, don''t hesitate - it is still a great product and still much more comfortable to use than trying to read a book on an iPad - even if it is an iPad Mini.But... There are a few things that I thing Amazon should fix on this one, specially because it is the top of the line Kindle:1. The battery cover just keeps disconnecting from the reader itself. The magnetic attachment is just not strong enough to keep it in position as you manipulate the reader. Previous covers just stayed in place and even the Apple magnetic cover attaches better than this one.2. As you are able to turn off the page buttons on the side, you should be able to turn off page turning on the screen. The way I got used to handle the kindle and as I constantly change hands when I am reading, I get a lot of undesired page turns because I touched the screen somewhere. A very simple fix that could be in one of the next software updates that would greatly improve my perception of the device.3. Battery life (even with the cover) is far from what I expected. My old Kindle had a battery that lasted for more than a month, the new one needs recharging every 15 days.4. The device itself is so light and the battery cover so cumbersome that it should come with a simple,e cover just to protect the screen when you throw it in the bag.5.Read more', 691, 65);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (39, 1, 3329, 'I have had Apple TV and Roku for over a year and I can say without reservation that the Amazon Fire TV is far better for two reasons: 1. The program/movie I want to watch starts IMMEDIATELY with a single click, unlike Roku and Apple TV which can take forever at times after several clicks. 2. Voice search. Having to type search can be cumbersome and a nuisance. Unless I want to watch one of the ITunes movies I own on the Apple TV, I always use the Fire. It''s simply better', 5, 207);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (52, 3, 4944, 'Out of the box mine updated and setup fine. - No ProblemsMy biggest complaint is that Voice Search only searches Amazon and a very few things from HuluPlus... Should search ALL content from at least the Big 3 (Netflix, AmazonPrime HuluPlus)Had some picture glitches on HuluPlus Netflix. I switched over to my Roku3 on the same content and worked just fine...I didn''t like the Menus... Not as easy as Roku...Netflix looks and works WAY BETTER on Roku3...I think this might become a player in the market that Roku owns... Maybe... But has too many problems for me to bet on that at full price... I might buy one later when they go on sale and the software''s been tweaked... Along with more channels added...Considering you can buy a Roku 3 for the same money or less, with a HUGE list of public private channels, also search that really works... The Fire TV is, at this point, a very bad choice... Don''t pay them list price to be a Fire TV Beta Tester...', 425, 76);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (53, 4, 3911, 'The product it amazing love that it turns in lights on and plays my favorite music.', 748, 272);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (54, 1, 333, 'An Amazon.com official commented on this review(What''s this) The Amazon team saysJuly 30, 2014Hi Dallas, thank you for sharing your feedback. We wanted to let you know that we made it easier to find your favorite Prime content with the click of your remote. You can now browse many more Prime-only categories, including Top Prime TV, Top Prime Movies, Prime TV for Kids, Prime Movies for Kids, Prime TV by Genre, and Prime Movies by Genre.', 609, 416);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (40, 4, 4446, 'This review is for the second generation Kindle Paperwhite. Like all kindle e-readers before it, this is a great product. However, I am a bit disappointed as there is not a huge improvement over last year''s model. For this review, I focused on features and enhancements exclusive to the new Paperwhite and tried to make comparisons to last year''s model. Also, I found somethings misrepresented or confusing in the advertising, so I will try to clear them up.HARDWAREDesign - The Kindle white has a nice look and shape. It fits well and is easy to hold in one hand. It''s fairly light, so it doesn''t tire the hands too much. I can grip it for long periods before having to switching hands. Its design is very similar to the previous Paperwhite - almost identical. The height and width are the same, the buttons are in the same location, and although this version is slightly lighter, it is not noticeable.Display - Although not a huge improvement from last year''s model, the display is one of the best features of the Paperwhite. Like most e-readers, the Paperwhite uses digital ink technology. This model employs a more advanced version. In addition, the lighting has been upgraded, so among other things, it is more evenly lit. Together, they make for incredible viewing. In my opinion, it''s one of the best digital ink e-reader display on the market. I really enjoy reading on it, text look very sharp and crisp, with little to no eye strain.Processor - The Paperwhite has an upgraded processor, which means smoother page turns and navigation. I am able to open books, flip pages, and navigate menus fairly quickly. There is barely any lag as I flip through many pages at a time. Also, the flashing effect when turning pages shows up less if at all.Read more', 739, 112);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (41, 4, 7927, 'Ok first things first, I also own a Echo and if you own a Echo you will love the Tap.Now you will see a lot of reviews around the internet of people saying they wish the Tap was voice enabled like the Echo. I happen to think those people are not completely thinking things through. Because the Echo is not meant to be a mobile device. It generally sits somewhere in your house and the voice command is then a great feature to have. But the Tap is meant to be mobile, and therefore I am happy it''s not a Voice command device. I would not want to be at the beach or on a subway or at the coffee shop and having this thing think the world is taking to it. So I actually think not having a voice command is a well thought out feature. I have the Echo on my kitchen counter and the Tap in my Studio office. And when I leave my office I just grab it and go.I bought this on sale for 89 and I went to the store and listened to many Bluetooth speakers. And while yes the charge 3 sounds better, all the charge 3 can do is be a Bluetooth speaker. While the Tap is so much more for less . And the Tap sounds Great. After looking online I was a little nervous that it would not sound that great, but I was 100 wrong about that. There is no other product out there for 89 that sounds this good and can do what the Tap does.I was not paid or given a Tap to write this review. I''m just a consumer who was it the market for a Bluetooth speaker, and I could not be happier with my choice.Also if you buy this device buy the Amazon sling as well. Trust me you will want it. And honestly I am again happy I got the one that covers the bottom of the Tap. Because if this was sitting on a table and someone knocked over a drink I would not want the bottom where the charging rings are to be exposed.That''s it, that''s all. Buy it, you won''t be disappointed!!!!!', 724, 84);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (42, 5, 7635, 'I assumed, based on the product description, that access to 40,000 Songs meant that I could play my own 2800 songs on the cloud that I also pay Amazon a couple hundred dollars a year for. Why not a cloud player app for crying out loud. If I''m mistaken and I CAN access my cloud music, I sure appreciate it if somebody could tell me how. That''s why I bought it. I might return it because I can already get everything by Amazon''s own content through other means. Kind of a drag that I can''t play my AMAZON PURCHASED music through my expensive home theater. I couldn''t care less about viewing my Amazon cloud photos on my home theater.', 403, 160);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (43, 2, 5024, 'I have a regular echo and now the tap. Both awesome products, use them to control lights, locks, and play music. Would buy again.', 679, 182);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (44, 5, 5338, 'Best kindle so far.', 544, 380);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (45, 4, 1784, 'Only 4 stars because I found it very confusing at first. I had a Kindle before found it very easy to find what I needed to do. The user guide didn''t really answer my questions, but I persisted am getting used to it. I really love the backlit screen no buttons to push to change pages. At first I wasn''t sure about the smaller screen, but didn''t take long to get over that. I''m sure I''m just a creature of habit not very techy. All in all, the Kindle Paperwhite is great.', 941, 458);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (46, 1, 1459, 'I''m your typical middle-aged woman - I don''t game, and I''m not super tech-savvy by any means....so take this review for what it is. The Fire TV was easy to install and I''m loving all the features, free movies, music and simple interface - this thing even has a screen saver that comes on when you''re listening to music! We''ve always just had our Comcast cable service without DVR and occasionally used Comcast OnDemand to watch/rent movies - but I''ll never watch from Comcast again. The voice recognition software is amazing and brought me to exactly what I was looking for every single time I searched. It''s just so easy to find what you''re looking for (unlike Comcast), and since I''m an Amazon Prime member most of what I want to view is free - oh and for the new release movies the cost to rent from Amazon is on average cheaper than Comcast OnDemand by a 1 or more. So happy with this purchase!', 835, 251);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (47, 1, 4017, 'Updated 12/8/2014One year in...This review is for the the no-ad 64 GB wifi-only HDX 8.9.I use a Galaxy S5 Android smartphone so the HDX is for media / web surfing / offline viewing for travel. Since I had already been using Amazon Prime and Prime Music it was a no brainer for me to use the HDX to fill the role of media / web surfing on a tablet.Be informed about the download limitations to this device. Amazon has been adding clarification to this which should help would-be purchasers make a more informed opinion. This wasn''t as obvious as it should have been when I ordered mine so they''re listening which is good.Be aware that their most popular Prime content *may* not be available to download (and save) to your HDX. You can save certain videos to your HDX but you won''t know which ones until you buy an HDX and try it out. *** Edited 12/21/2013 You can now see a list of Prime movies and shows that can be downloaded to the device. That''s an improvement and more clearly shows the available downloadable Prime content. +1 for Amazon. ***I was also under the assumption that you could download as many videos as you''d like with the limiting factor being the memory capacity of the HDX. Also NOT the case. So again, I bought the larger capacity HDX under this assumption. That was dumb on my part as it turns out because you''re not limited by storage capacity. You''re limited the NUMBER of downloads you can have on your device. Kids'' content can be really short so you may find yourself running into that limitation, but most people never will.Read more', 964, 303);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (48, 5, 5490, 'I brought this for my 5 year old GranAngel she loves it the size is just right! The child proof case is ideal for her.', 927, 102);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (49, 5, 7246, 'First rate - high quality!', 760, 269);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (69, 4, 6328, 'other than not being voice activated like the Echo, it''s just as good if not better', 750, 61);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (55, 4, 418, 'This is my second Kindle, I also have a 3G Kindle touch, and of the two, I prefer the touch overall.Features I like about the Fire: I love and hate the carousel all at the same time. I love how easy it is to scan through the books that I have on my Kindle and seeing the pictures of the covers (because sometimes I like to pick my books based solely on the cover). I don''t like how every book I purchase shows up on the carousel whether I''ve sent it to the Fire or not (there may be a way to stop that from happening, but I haven''t figured it out yet if there is.)I really like having my Fire connected to my Goodreads account so that when I finish reading a book on the Fire and write a review for Amazon, it also posts to Goodreads for me without any extra work on my part.I also like being able to read on my Fire without an additional light source.I do not like the glare on the screen while trying to read in sunlight. For me, the Fire has been basically useless anywhere that sunlight is involved, which includes car rides on sunny days as the sun shining through the car windows creates too much glare to read. I''ve seen some people mention a way to sort of solve that problem, but I have yet to figure out how to do it, and instead just take my Touch with me if I''m going to possibly anywhere near sunlight.', 800, 63);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (56, 1, 4995, 'This is my first kindle since the 1st generation. That tablet went away after a couple years. Kindle Fire 7th gen is a great tablet for the money. Honestly, I don''t use it for reading. I use it for browsing websites, social media, and listen to podcasts. I use my Bluetooth headphones to listen to the podcasts. The couple times I''ve used the speaker on the tablet, I haven''t been disappointed, but I wasn''t impressed. It works just fine for watching videos in bed. Had no problems hearing. Search Google for some tips and tricks to get apps from the google play store. Silk browser is terrible. I reccomend installing Opera. I reccomend this tablet for people like me, who want to just lay in bed or on the couch and doing simple tasks on the tablet. Don''t need a 300 or 400 tablet to do what I''m doing.', 900, 61);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (57, 5, 4623, 'This new KFHD replaces last year''s basic Kindle Fire. Although it has some cool new features, it lacks a camera, microphone, and HDMI port. For this reason, I''m glad I kept my 2012 model since it does have these 3 features! Here are my initial impressions of the 2013 Kindle Fire HD: I like the placement of the on/off volume buttons. Being on opposite sides makes it unlikely to hit the wrong one. I never cared for the carousel (this is what you see when you turn your Kindle on and it contains all the books apps you have recently accessed), and now there''s an option to have favorites showing on the home screen instead, and the apps/books can be rearranged to your liking. I was very surprised that web pages can no longer be placed in the favorites bar (which is now being called home). I don''t know why Amazon removed this option, and we also are unable to have the last accessed web page appear in the carousel. But you can still bookmark your favorite web pages YouTube videos for easy access. When I play songs purchased from Amazon''s MP 3 store the lyrics scroll down karaoke style. Nice feature, but it doesn''t work on every song. This device has a cool new feature called Quick Switch, which allows us, when reading or using an app, to bring up recently accessed items with a swipe instead of having to exit the book or app you were using and go back to the home screen to open up another one.In terms of sound, I find it to be tinny and not as rich as it is on the original KFHD. But you can really improve the sound of music by wearing a good set of ear buds. Ironically, music sounds muffled unless you hold the device in landscape mode with your hands covering the speakers. Holding it this way projects the sound out to you.Read more', 36, 206);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (58, 4, 7354, 'This is a great product I would highly recommend getting it', 121, 382);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (59, 5, 3026, 'I bought these for a couple of reasons.First, I wanted an earbud that was NOT designed as noise cancelling. I hate having to shove headphones into my brain to use them. Apparently, a lot of people are under the assumption that these are supposed to be noise cancelling or something which they are not. They are simple earbuds. I hate not being able to hear what is going on around me and don''t feel safe in public using headphones that block everything else out. These are designed just like the old style earbuds that you stick in your ears but they are more comfortable. Maybe I have small ears or something but they could never fall out or dislodge from my ears. They don''t cancel the outside noise but they sit in my ears exactly as they are supposed to so the sound travels right into my ears.Second, I really like the magnets and tangle free aspects of the headphones. I use headphones while I work and the magnets allow me to hang the headphones easily when I am finished with them. The flat cord and magnets also mean the headphones never really tangle when you put them in a bag or wherever. Awesome design.Finally, the sound I get out of these seems pretty average. I would compare them to the stock Apple iPhone earbuds or a set of Sony earbuds. Nothing special. They are only 25 and a lot of that is the fact these were just released and that you are paying for the design as far as magnets in the ear buds and the nice flat cable. Don''t expect them to perform like 100 headphones because they aren''t designed to perform like that. They are just a nice simple set of earbuds that will sound good to most people. The magnets and tangle free cord are awesome and they are really quite comfortable.Read more', 254, 151);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (60, 5, 5337, 'This is a great on-the-go speaker. I like the fact that it sits on a charging cradle instead of having to plug in. Also, bonus: Alex. I like the update they have done to it as well where you don''t have to push the button to activate her, you can just say her name. If you are looking for an echo with a decent speaker without paying too much, choose this one. Spend more,m and you can get the regular echo which has a better booming sound, but you can''t travel with it.', 367, 236);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (61, 1, 835, 'Has great sound, clarity,alexia has great responses', 715, 238);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (62, 1, 3406, 'I couldn''t decide on which one to buy. They all do the same things, but ended up buying the tap which is portable. I take it on my deck with a cup of coffee and listen to the music I put in through pandora and iheart radio. I absolutely love it, and so does my husband.', 527, 352);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (63, 5, 1880, 'This case is very well made and sturdy. It perfectly matches the color of the tablet. I cannot figure out how to use the back as a stand. There is only one way it folds so it should not be that difficult. It does not work for me so I have given it a 4 star review.', 424, 362);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (64, 2, 2460, 'Alexa on the go. Works as Bluetooth speaker with your comparable phone.', 16, 144);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (65, 2, 6026, 'Great item, good service from Best Buy. It is uncanny that new and unique products are introduced often.', 276, 420);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (66, 3, 4625, 'I habe the echo and I bought this one fort my son''s room but it''s not as user friendly. I wish I would''ve just bought the other one.', 891, 500);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (67, 5, 2442, 'I ordered this and actually came in earlier than predicted and it works beautiful! I''m totally happy with my purchase!!!', 361, 169);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (68, 5, 1073, 'Now that you don''t have to actually tap it to get the full function out of it, its great. Have the original Echo, and the Dot also. Wish I had only bought two of these, the charge is great and we take it wherever we want to go.', 315, 418);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (73, 1, 272, 'I am a huge fan of the echo. That being said this is the last one I would buy. The original echo''s speaker sounds much better and is hands free. The dot has great connection Bluetooth and more importantly audio out to plug into a stereo system. I bought this for the purpose of being able to carry outside around the house when working in the yard. The sound is not as robust as the original echo (not portable - no internal battery), but good enough when in the yard to at least have music.', 802, 138);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (74, 4, 1835, 'Still in the learning process--looking forward to more benefits!', 875, 30);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (75, 4, 6676, 'I have several echo dots around my home, but this makes it easier for me to carry into a room that doesn''t have one and control things around the house, listen to the news or music. It holds a great charge.', 95, 312);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (76, 3, 7888, 'I love the fact that it has the kids free time thus limiting what your child can read. Plus the parental controls the you can set time limits. It gives a parent full control over what and for how long a child can read.', 265, 378);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (77, 4, 7984, 'I''ve had this for about 8 months now. And in those 8 months I''ve switched back and forth from this remote, and the tiny remote it came with. I lost the tiny remote behind my bed 2 months ago and since I''m lazy, it''s still down there. So I''ve had to rely on the game controller for everything (sad face).And that''s not a good thing.....battery life is laughable. This controller is never farther than 7 feet from the box and yet, 9/10 I ALWAYS GET THE ANNOYING LOADING/CONNECTING DOTS.This cost 60. And for that amount of money, It should be CONNECTING to a box that''s 7 FEET AWAY.damn you amazon, I still love you tho.', 15, 39);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (78, 3, 2270, 'Charger has worked well for charging my Voyage. Comes as a separate purchase from the Voyage which I found. Think it should be bundledwith the purchase price of the Kindle Voyage.', 101, 58);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (79, 4, 7663, 'We now have one for everyone in the family and no longer share. I would have no problem recommending this to a friend.', 744, 464);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (80, 1, 5944, '(The volume does not work with the iPhones. Please, if you have an iPhone, do your research before buying them, e.g. first line of product description. These work WELL for androids)I wanted to give these headphones a try, so I preordered them at the end of June. They finally came today and I got to try them out.FEEL: They feel like the Apple EarPods headphones when its in your ear. For me, it''s very comfortable. I haven''t had a chance to keep them in all day, but I''ve had them in for 30 minutes to an hour at a time.AUDIO: I''m not a complete audiophile, but I do like the occasional nice set of headphones. If you''re thinking these are a nice set of headphones, then don''t even think about ordering.I guess I would say they''re pretty similar in sound to the EarPods, but I would definitely give these a step up from the apple headphones. Hands down.One thing I did love about the EarPods, was that I could still hear everything around me while I had both headphones in. These are the same way. Some may not like it, but I think it''s perfect for use around the house, at work, or even for working out. I like for the fact I can still hear things going around me. If the ambient noise is too loud, just turn up the volume.I do want to say, that so far, they seem to have good lows and mids. It''s pretty crisp in sound. The bass isn''t too bad either. It''s not like a Skullcandy set of headphones, but the bass IS there (honestly better than I would have expected for these headphones)LOOKS: I love the black look. Tangle free cord is very nice to have, and I also found it interesting how the section above the controls are the regular thin cables to make it lighter when dangling.Read more', 711, 410);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (81, 5, 2606, 'Alexa works great and does lots of things for you. Fun for the family.', 876, 366);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (82, 5, 6, 'This case is overall quite nice, but has started to peel apart on the edges a little. I will try to update this review later on after I see how it holds up.The tablet automatically locks, and wakes the screen when closing and opening the case, which I think is the most appealing part about this case.', 950, 470);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (83, 1, 5157, 'My remote went out just a couple weeks after we received the Fire Stick.Put new batteries in it and it worked another couple weeks. Then, I didn''t have time to get to it until the return time was out. I tried batteries again, cleaning the ports, and everything I could think of. Because I can''t get the cheap remote working, this Fire Stick is STUCK on the television on which is was originally installed.... until I pay for a new remote. Amazon, you can do better than this. I see that there are many, many posts of people like me whose remotes just don''t work. A phone app is nice, but shouldn''t HAVE to be the only answer besides another remote that costs 30 of the original whole product.', 215, 270);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (84, 2, 4002, 'Good product works amazing . Works awesome from home .', 998, 413);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (85, 1, 6563, 'The refurbished Kindle looks brand new, I wouldn''t even know that it was used. The only down side was that when I opened up the package, the Kindle was already on.', 57, 397);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (86, 2, 877, 'I''m a huge fan of the Echo family. I have two Echo''s, three Dots and one Tap. No they aren''t essential to my life but I love playing music, listening to the news and controlling the Philips Hue smart lights throughout my home. It was a large investment that most of the population won''t make - with that being said I am not a huge fan of the way the hockey puck Dots look like. Glossy plastic looks a little cheap to me although it has no effect on the performance of them. Having the Dot cover is a great option and it looks fantastic.Some reviewers say they look cheap or fit too loose - I''m not sure why people are moving their Dots. Since Dots are made to be stationary, have a loose fitting cover isn''t an issue. To me, it fits perfectly. They also aren''t made of real fabric, but the important part is that it does look like the fabric in the picture. Not being fabric is a better option considering plastic is much more durable than material and will hold its color better if your Dot happens to get sunlight.I bought three covers - Blue, Grey and White. They all look good but the grey is my favorite as it doesn''t attract more attention than it needs to. With that being said, I like all three colors.', 432, 253);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (87, 2, 5596, 'This is the middle model of the three models that Amazon is shipping this year: the Kindle Fire HD, the Kindle Fire HDX (this tablet), and the Kindle Fire HDX 8.9. This is the successor for last year''s Kindle Fire HD but with an updated operating system and new features, a redesigned shell (with the power and volume control buttons more readily accessible), an absolutely amazing display, superb sound, an included power adapter, and the new Mayday feature. See http://www.amazon.com/review/RNH700DOM9WN3/ for my review of the Kindle Fire HD and http://www.amazon.com/review/R2YPITHVTYLCZT for my review of the Kindle Fire HDX 8.9.Update: Some users are reporting a bluish glow around the edges of the screen for the HDX. If you search on YouTube for HDX Blue Haze, you can find a video showing the issue. Amazon has updated their Learn More link with the following info:To achieve the perfect color accuracy on Kindle Fire HDX 7 at the lowest possible battery consumption and device weight, we used blue, not white, LEDs. Blue LEDs allow for a much more accurate and rich representation of color and result in an up to 20 improvement in power efficiency.As a result of using these blue LEDs, you may notice a very narrow, faint blue tint around the edge of the device when looking at items with a white background, such as books or web pages. All displays have some level of light emission around the edges, and the light on the Kindle Fire HDX 7 is blue due to the technology used to render perfect color accuracy.If this is something that you think would bother you, I''d recommend taking a look at the YouTube video or taking a look at the HDX at a local Best Buy or office superstore. I''ve also uploaded a user image here of my HDX with a book loaded so that you can see the blue glow (http://www.amazon.com/gp/customer-media/product-gallery/B00DOPNO4M/).The Amazon tablets are primarily content consumption devices, best suited for connecting to the Amazon ecosystem, including videos, music, books, apps, and so on. With the free Prime trial subscription, you can check out the Prime Instant Video options and watch movies and shows at no charge for 30 days. For videos, music, and books, the Amazon selection is at or near the top of the list for apps, much less so. 90 of the top 100 apps are available on Amazon.com, as well as 100,000 others, but that''s only a small fraction of what is available with Google or Apple.It''s not quite as bad as it sounds because, while the competition has ten times as many apps, most of those apps are, um ... how shall I put this ... less than stellar (look up Sturgeon''s Law). If there are specific apps you need or want, you definitely should double-check before purchasing to make sure that they are available. The apps that will likely never become available on the Kindle Fire ecosystem are those apps that require Google services (i.e., anything that uses Google location services). One ameloriating factor is that it is possible to side-load most of the apps from the Google Play store onto an Amazon tablet and a web search on side-loading apps onto Kindle Fire will show dozens of websites with detailed instructions. If the app you are sideloading requires a Google service to work, though, it will not run on the Fire, even if you manage to successfully install it.Like the other Kindle Fire tablets, as well as the Apple iPad and the Google Nexus, the Kindle tablet line doesn''t have a micro-SD slot, so the assumption is that you''re consuming content from the cloud. This is fine when you''re using your tablet with wifi not so good when you''re traveling and want to load up your tablet with content for the trip. If the latter is something you expect to do regularly, you might want to consider the 32GB or 64GB versions, or pay the additional price for the 4G version, which is available on the 7 tablet for the first time. Also, if all of your content is on iTunes or on Google Play, you would have to side-load everything onto the tablet. As is true of Apple and Google tablets, there''s no way to automatically connect to the cloud storage of the competition.Something new this year is the ability to download Prime Instant Videos. I verified that I can download Prime Instant Videos to my Kindle Fire HDX. However, that option is not available for all movies and TV shows. It looks like they had to get the permission of the studios and not all of them said yes. So, for example, I was able to download Casablanca but not able to download The Avengers even though both are part of the Prime Instant Video collection and both are available for free streaming.Update: Adding a bit from a reply in the comments: Amazon is clearly looking at the Enterprise market with this launch, at least based on the details they provide. They''ve added full accessibility support (required in order to get government contracts), will be bringing support for VPN and business printing, have a better email client with tighter integration to Exchange, and are including OfficeSuite for productivity. There are other productivity tools available in their app store, as well, although both Google and Apple, particularly the latter, have more options. When VPN support arrives, I''ll definitely be taking a look, as it would be nice to not have to lug my laptop home every night.So how does this Kindle Fire HDX differ from the previous generation Kindle Fire HDDisplay: 1920x1200 (323 ppi) vs 1280x800 (216 ppi). It''s more than that, though, as the colors are richer, brighter, with better contrast. This display has been judged by many reviewers as the best in its class and I would have to agree. Amazon has also added technology to automatically adjust the contrast and brightness when viewing the tablet in bright sunlight. While there is definitely a noticeable improvement, this isn''t what you need for reading on the beach. For that, you''ll need an eInk reader like the Kindle Paperwhite.Sound: As far as I can tell, the sound is about the same. This was already one of the best-sounding tablets on the market, with Dolby stereo output and enough power to actually make it possible to listen to music or video without requiring headphones.Size and Weight: Noticeably lighter (10.7 oz vs. 13.9 oz) and noticeably smaller (7.3 x 5.0 x 0.35 vs. 7.6 x 5.4 x 0.4). This is a comfortable tablet to hold one-handed, even for long periods of time.Processor: It''s a *lot* faster (2.2GHz quad-core, top-of-the-line CPU, compared to 1.2GHz dual-core). This tablet is amazingly fast and smooth, with the fastest processor in its class. Every game I''ve tried on it has run smoothly, with no hesitations, slowdowns, or glitches. Scrolling through content is amazingly smooth and fast now, without the hesitations and occasional slowdowns of the previous generations.Build: A redesigned shell with power and volume control buttons that are easy to find! This is a solid build but the back of the shell is something of a fingerprint magnet. Since most of us will be buying a case to put the tablet in, that may not be an issue.Camera: If there is a difference between last year''s camera and this year''s, I''m not able to see it. It''s a high-def camera suitable for video-conferencing or Skype. Like last year''s model, there is no rear camera. If this is important to you, you''ll need the 8.9 version.HDMI Output: This is the one area where last year''s model wins. Amazon has removed the HDMI out connector from its tablet line (but see the description above for details on how Amazon is providing a software solution for sharing your tablet screen on your television). No other tablet that I''m aware of has this functionality so if this is something you need, you should be able to purchase one of last year''s models fairly cheaply.Battery Life: The same, at 11 hours. However, Amazon has added a special reading mode to the device, which they claim will extend the battery life to as much as 17 hours. I did not test this. For my own personal use, the battery life is adequate.Price: It''s more expensive (229 vs. 199) but this year they include a power adapter, which was a 20 extra last year, so the actual difference in price is 10. For what you''re getting, that price increase is definitely justified.It has an updated OS and updated feature software (including the free unlimited Mayday customer support feature). The software updates include the ability to download some Prime Instant Videos to your device and watch them offline, enhanced accessibility, enhanced enterprise controls and features (so now it''s better suited for office work), enhanced email client, enhanced parental controls, improved X-Ray features (now including lyrics for music, as well as additional information for both books and movies), integration with GoodReads (coming soon), and the like.Where I noticed the biggest difference was the home screen. The default view is still the carousel but if you swipe upward, you''ll see a more traditional icon view. The Recommended for you display on the home screen is now smaller and much less obtrusive (and it can be turned off in the settings). Amazon has also added multi-tasking of a sort, where swiping up from the bottom of the screen while you''re in an app shows you the 20 most-recently-used items from your home screen, so you can quickly switch from one app to another without returning to the home screen.There is also a left panel available on most screens (but not the home screen) and in some of the apps, with navigation links and settings to make it easier to navigate and control your tablet or to navigate within the app. If you tap the center of your display and then swipe left while you''re reading a book, for example, you''ll see a panel that shows you the table of contents, the About the Author link, the Sync to Furthest Page Read link, and so on.The Kindle FreeTime option and the parental controls are still among the best in the business. If you want a tablet for a child and want to control what they can access, how long they can use the tablet at any given time, and the like, Amazon has you covered.You can now also schedule Quiet Time on the tablet, where notification sounds and pop-up notifications are disabled, either on a temporary basis by simply pushing a button or on a scheduled basis. Frankly, I doubt I''ll ever use this feature but if you''re the type who likes to read or watch video until you fall asleep, it''s kind of nice to be able to disable all sounds so that you don''t get rudely awakened when, e.g., someone plays a new word in your Words with Friends game.Mayday: This is a huge gamble by Amazon and it will be interesting to see whether it pays off. This isn''t a feature for a techie like me and I didn''t use it (although I was sorely tempted). From the commercials, it''s pretty amazing, particularly that you can get a live chat in a matter of a minute or less (Amazon''s goal is something like 15 seconds, I believe, although I can''t help wondering what will happen on Christmas Day!). If you''re thinking of getting a tablet for a technophobe, the addition of this feature may make the Kindle Fire HDX your best choice.How does this tablet rank against the competition There are really only two other tablets in its class currently: the Google Nexus 7 and the just-announced Apple iPad Mini with Retina Display.Display: All three devices have retina displays, with the 7 HDX and the Nexus at 1920x1200 (323 ppi) and the 8 iPad Mini at 2048x1536 (326 ppi). All three displays are stunning. Amazon claims that it has enhanced the ability to read the display in bright sunlight, something that''s a problem for all such devices. While this wouldn''t be my first choice to read by the pool (I''d pick the Paperwhite), I can testify that it is easier to view the display in bright sunlight than its predecessors.It''s worth noting that the aspect ratio of the HDX and Nexus is 16:10 while the aspect ratio of the iPad Mini is 4:3. Where this matters is watching video. If you''re watching an old television show, a 4:3 aspect ratio is fine. If you''re watching a high-def movie, the 4:3 aspect ratio is going to leave large black bars on your screen and the video will be much more compressed than it would be on the HDX and Nexus. Apple chose to maintain backward compatibility with prior devices rather than moving up.Sound: The HDX has Dolby Digital Surround Sound the Nexus has Frauenhofer Surround Sound the iPad Mini has stereo sound. The iPad Mini also makes the same mistake that Amazon made in its first-generation tablet: putting both speakers on the same side (in this case, at the bottom of the tablet). If you''re watching a video, you''ll have the tablet turned sideways and the sound will all come from the same side. The HDX, in contrast, has the speakers placed perfectly for video watching.Networking: The HDX and the iPad Mini both have dual band, dual antenna (MIMO) Wi-Fi. The Nexus is dual band but not dual antenna. All things being equal, I would expect the Nexus to lag a bit behind the others in networking performance, particularly in areas where the connection is spotty.Size and Weight:HDX: 7.3 x 5.0 x 0.35 and 10.7 oz.Nexus: 7.9 x 4.5 x 0.34 and 10.24 oz.iPad Mini: 7.87 x 5.3 x 0.29 and 11.68 oz.There''s really nothing to choose from here. All three are small, thin, and light. The iPad Mini is the heaviest but it also has a slightly larger screen.Processor:HDX: 2.2 GHz quad-core Snapdragon 800 processor, 2GB memoryNexus: 1.5GHz quad-core Snapdragon S4 Pro, 2GB memoryiPad Mini: 64-bit dual-core A7, 1GB memoryThe HDX and iPad come out ahead of the Nexus on processing power while the HDX and Nexus come out ahead of the iPad Mini on memory. The A7 is only a dual-core processor but according to some tech sites that have run benchmarks, it definitely holds its own against the quad-core Snapdragon. These are all pretty powerful tablets.Cameras: Both the Nexus and the iPad Mini have 1.2 MP front and 5MP rear cameras. The HDX only has a front-facing camera. If you expect to take pictures with your tablet, the HDX isn''t for you.Battery Life: HDX 11 hours (17 hours when reading) Nexus 9 hours iPad Mini 10 hours. Amazon wins this one, particularly if you will be spending a lot of time reading.Expansion: None of them have a microSD slot they all assume that you''ll be using their respective cloud systems.Parental Controls: All of them have the basic parental controls that allow you to limit your child''s access to content, purchases, the web, and so on. Amazon goes farther, though, with the Kindle Free Time and Kindle Free Time Unlimited options, the latter of which is an inexpensive subscription to a curated library of content. If you are buying a first tablet for a child, I''d choose the Kindle Fire HD. At only 139, it is significantly cheaper and it has all of the options that the HDX has.Enterprise: As soon as Amazon releases its update, it will add VPN and network printing support. I believe all of the tablets have basic enterprise capabilities, including that support and various office apps. For real productivity, though, personally I''d go with a laptop, not a tablet.Support: Amazon wins this category, hands down, with the new Mayday system. Apple comes in second, with Apple and Amazon usually taking top marks in any customer support survey. This is an area where Google does not shine.Price: The HDX and Nexus win this one, hands down. Both are priced at 229 vs. 399 for the new iPad Mini. Neither Google nor Amazon makes much, if any, money on their tablets they''re counting on you to purchase content from their respective stores.From my own perspective, there is no single clear winner, as each tablet has strengths and weaknesses. If you already have Amazon Prime, the HDX is a no-brainer, with the access to the Prime Instant Video and the Kindle Owners'' Lending Library. If you''re primarily buying a tablet to read with, Amazon wins there, as well, with the 17-hour battery life while reading and the best display for reading outdoors. If you want apps, Apple and Google both have far more choices. If you want to watch movies, I''d pick either the HDX or the Nexus, as Apple''s aspect ratio and its lagging sound put it at the back of the pack. If price is a factor, then you should pick either the HDX or the Nexus.If you''re heavily invested in the Apple ecosystem, i.e., you already own an iPhone or iPad and all of your content is on iTunes, the HDX really isn''t the tablet for you. Similarly, if you love browsing Google Play for apps to play on your Samsung Galaxy phone, you''re likely to be disappointed in the section available on Amazon (although, as I note above, most of the Google Play apps can be sideloaded onto the tablet). If you love your Google Now or Siri, neither of which will ever be available on Amazon, this isn''t the tablet for you.The bottom line: This tablet is primarily intended as a viewport into Amazon content and Amazon services. If you have Amazon Prime and you have Amazon eBooks in your collection, this tablet is a no-brainer. The price is low, particularly for what you get, and it''s a small, light, high-quality, high-powered, tablet with a stunning display and superb sound. This really is one of the top tablets in its class.Note: As others have noted, the tablet will update its software when you first turn it on and connect to wifi. Unlike some others, I had no trouble with this operation, no glitches or crashes. It took several minutes but the process ran smoothly, as did the tablet when everything was done.Update:Now that I have a Kindle Fire HD and a Kindle Fire HDX tablet, I''m in a little better position to talk about which one I''d recommend:You should get the Kindle Fire HDX if:- You''re a techie who wants the latest and greatest, the best display, the fastest processor.- You need a camera for Skype or other video app.- You play graphics-intensive games (e.g., racing games).- The size and weight matter to you, even in such small increments as this.- You think you will need the Mayday technical support.You should get the Kindle Fire HD if:- Price is a factor. 90 cheaper is not an insignificant amount. This really is an excellent value for the money.- You want an inexpensive tablet for a child (and, for this case, the lack of a camera might well be a plus)- All you want is a basic tablet for reading books, playing music, watching the occasional video, playing Words with Friends, and the like. While the screen on the HD isn''t as stunning as is it on the HDX, this is still a true HD screen and it is very good.I check back pretty regularly, so if you have a question, please feel free to ask and I''ll do my best to answer it. Read more', 921, 490);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (93, 2, 82, 'This has been a very nice addition, it allows the whole family to use and enjoy it.', 690, 482);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (94, 1, 890, 'Love the color of the cas and seems to protect well. Loving this case.', 982, 497);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (88, 4, 6595, 'Update on Dec 23 2013 - Please scroll to the very end of this review for 2 month use update. ...For those who are looking at getting the best tablet out there at the moment, this is the one you should be looking at.My profile: Heavy tablet users for personal and business purposes. I work on my tablet around 4-5 hours a day (Email / Documents / Spreadsheet / PDF ) and use it 1-2 hours for personal use such as watching movies or reading books/magazine. Tablet is my go-to device for all internet related search I do.I have the following and/or used the following before:1) iPad 12) iPad 23) iPad 44) iPad Mini5) Kindle Fire6) Kindle Fire HD7) Kindle Fire HD 8.98) Asus Transformer with Keyboard9) Nexus 7 First Gen10) iPad Air 16gb WifiAs you can see, I been through many devices and hope this review with my experience helps users decide if this is the right device for them. This will be an ongoing review for this device throughout this next year. For comparison sake, I will use last year''s Kindle and iPad mini as they are the closest size to this HDX 7Speed (9/10):This is leaps and bounds faster than last year Kindle HD. Last year Kindle struggles to go through any HD video content I put in. This year''s HDX able to play seamlessly all the HD 1080p contents I added. It is incredible how much the 2.2Ghz quad processor improved vs last year''s model Dual 1.2Ghz.Screen (9/10):This is the biggest improvement over last year''s model. The screen is in true HD 1080p (1920x1080). This means any HD content I throw at it will view in its intended resolution. The screen is crystal clear (much better than iPad mini) and the viewing angle is incredible.Read more', 232, 388);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (89, 4, 5295, 'Simply put, this is the Amazons iPad Air Killer. The 7 HDX is the iPad mini killer. Both HDXs inherent very similar hardware. This means the 8.9 version is an enlarged version of the 7 version. For my 7 version review, please search for my HDX 7 review.My profile: Im a heavy tablet user for personal and business purposes. I work on my tablet around 4-5 hours a day (Email / Documents / Spreadsheet / PDF) use the tablet 1-2 hours for personal use such as watching movies or reading books/magazine. The HDX tablet is my go-to device for all internet related search I do. It is also my main electronic device, more important than my smartphones and laptopsI have the following and/or used the following before:1) iPad 12) iPad 23) iPad 44) iPad Mini5) Kindle Fire6) Kindle Fire HD7) Kindle Fire HD 8.98) Asus Transformer with Keyboard9) Nexus 7 First Gen10) Kindle HDX 7 which I also have a review you can check outAs you can see, I been through many devices and hope this review with my experience helps users decide if this is the right device for them. This will be an ongoing review for this device throughout this year. For comparison sake, I will use last year''s Kindle Fire HD 8.9 and also the Fire HDX 7 as benchmarksSpeed (9/10):The same chipset is used on the Kindle Fire HDX 8.9 as it is in the Kindle Fire 7 As I mentioned in the 7 review, this is leaps and bounds faster than last year Kindle HD. Last year Kindle struggles to go through any HD video content I put in. This year''s HDX able to play seamlessly all the HD 1080p contents I added. It is incredible how much the 2.2Ghz quad processor improved vs last year''s model Dual 1.2Ghz.Read more', 926, 473);
