INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (91, 2, 7988, 'I have owned a Kindle for several years now. I have had the 2nd generation Kindle and I have had the Kindle Keyboard. When my mom expressed interest in getting a Kindle I decided to give her my Kindle Keyboard because she doesnt have Wifi in her house and my older Kindle Keyboard had 3G, which is what she needed. And I decided to buy the Basic Kindle for myself because (1) I didnt want to wait for the Paperwhite to come out and (2) I just needed Wifi and (3)and most importantly I JUST WANT TO READ A BOOK, not listen to text-to-speach, or go shopping on Amazon, or listen to music, etc. All I want to do is read a book...thats it! This Kindle is perfect for that. Its smaller and lighter, the pages turn faster than the Keyboard version, it basically has everything I need to download a book and read a book with a much better price than the Paperwhite or Keyboard. Yes, you have to navigate through the keyboard on this kindle with a 5-way controller, but I rarely use the keyboard anyway. To download a book, I just search and buy books on my computer and send them to my Kindle...which is much quicker no matter what version of Kindle you have. So if you dont need, want, or use all the extras then I would definitely recommend the Basic Kindle for 69 with special offers, because who really pays attention to the screen savers anyway.', 124, 454);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (92, 2, 6823, 'I pre-ordered this for my wife mostly to use as a Kindle E-reader as I figured the tablet would be slow and the display would be less than impressive. I was wrong. What a bargain this little beauty is! This model cost 49.00 but it comes with ad''s displayed on the lock screen when your tablet is dormant. Once your screen times out, they disappear. You can pay 15.00 up front to get an ad free version so I assumed to unlock the tablet I''d have to spend 15 to 30 seconds looking at an ad for Amazon Prime, or a product from the daily specials section of Amazon.com I abstained from paying for Ad removal and was pleasantly surprised to find that the ads are only on the lock screen and that as soon as I unlock the tablet they disappear immediately.Here are my pros and cons thus far.PRO:Perfect size for Ebooks, and web surfing to alleviate strain on the eyes from my 5 phone displaynice sturdy casing that gives it a nice heft but still weighs in as one of the lighter tablets on the marketChild Accounts- Amazon allows you to set up this tablet with age restricted access for kids making this a low cost piece of tech that is perfect for school kids and allows mom and dad to ration the amount of time lil Johnny can play Clash of Clans and how much he can hit the ol'' Visa card for.Battery life thus far wife was on it for about 5 hours last night and battery was at about 46Kindle Integration -this goes without saying but having my ebooks and audible books synced to the tablet is awesome and my Kindle books look greatPrice - it''s a 50.Read more', 656, 239);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (95, 3, 3967, 'For the low price, this tablet really does more than expected! The camera isn''t great however, I always use my phone for a camera so that doesn''t effect me. Here are some of the pros and cons:Pros: Low cost yet high tech Great screen quality (of course there is better out there, but it looks great as is) Smooth and responsive Easy access to amazon prime content Easy to wirelessly share content to a TV Battery life Web browser works greatCons: Doesn''t have some apps android users are used to having Camera quality isn''t great and no flash Less ''extra features'' than some higher priced tablets haveI opted to go with the 16gb version with no ads. The ads aren''t a big deal, but I figured I would pass on having them on my screen. No matter what version you pick, they all do the same things. The gigs may or may not matter to you. 8 and 16 gigs both aren''t very large, but if you want to predownload some tv shows, movies, music before a vacation, then you may want to look into getting the larger 16gig. If you will always have internet connection, then it isn''t much a problem since you have unlimited cloud storage and can download to your device or stream at anytime you have internet.Overall... If you want an Amazon tablet, and you want the best, go with the HDX series. However, if you want an amazing tablet but don''t want to spend as much, then these new HD 6 7 series are great! For me and my uses, the HD 6 is the perfect fit.I would suggest the 6 over the 7 for most buyers. The only 2 things the 7 has over the 6, are a larger screen, and dual speakers. Sure the dual speakers is kind of nice, but the screen is actually lower quality than the 6.Read more', 360, 34);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (96, 1, 7289, 'I like the Amazon Tap. I use it as a speaker in my garage for working out. It is tied to my Amazon Echo. I am able to use Alexa and Amazon Prime material. Would highly recommend.', 224, 71);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (97, 1, 7347, 'This thing has captured my wife''s heart. She reads every where, all the time. Vacation, on the way to church, At bedtime and far beyond. Books are so easy to get from the kindle itself It fits in her purse, I have to repeat everything , I always get, right after this chapter . Do not buy this for someone you want share LIFE with.', 428, 244);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (98, 1, 3740, 'When it works it''s great but for some reason it doesn''t always answer me When it doesn''t answer me I turn off the tv and make sure no one else is talking and it still doesn''t work at that time. It was easy to set up with the phone app. Doesn''t seem to matter where the phone is when it isn''t working. I''ve tried close and far and in between. So a case of great when it works and the pits when it doesn''t', 625, 57);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (99, 4, 3042, 'Amazing Sound! All around great product! Nothing negative so far.', 586, 146);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (100, 1, 2112, 'Major fan, didn''t buy this because of protection, bought it cause it will blend in to my decor. It is not a skin, so it''s not skin tight. Yes it''s loose but how often will you grab it and move it. Me maybe once every year.', 988, 78);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (101, 2, 6567, 'If you want a Tap to make use of Amazon''s Alexa voice services, then dont get one. The Tap is a fine enough Bluetooth speaker for wireless music, but the need to touch a button for voice services renders it far less valuable.', 477, 253);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (102, 3, 2669, 'We have the tap and the echo. I wouldn''t buy another tap. It''s the voice activation that is so good. But if you don''t mind having to push the button for every command then the tap is ok. But for me... only echo.', 965, 354);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (103, 3, 6299, 'Great sound quality from such a small item. Easy to hide so it''s not noticeable.', 609, 308);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (104, 4, 4148, 'I bought this as a gift for my girlfriend and she loves it.', 784, 221);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (105, 1, 4050, 'I''ve had Kindle Fire''s since day one and this is the only version that has slightly let me down. I''m having charging issues on a regular basis and occasional odd colors on the display. Also battery life isn''t nearly what I expected. If the charging issues continue I will put in for a warranty replacement.....', 587, 66);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (106, 4, 376, 'I am a fairly voracious reader - 120+ books/year, almost all on Kindle. I have purchased every Kindle edition as soon as it was announced. The price doesn''t bother me too much, as I figure with as much as I read, I make the money back by buying Kindle vs. hardcover books (since I mostly read new releases). This is the first Kindle that I sent back though.It''s not that the Oasis isn''t great - it is. The display is slightly crisper than previous Kindles. It''s not that it isn''t set up well - the buttons are placed well and easy to use, and the touch screen works fine. It''s really just a matter of personal preference. I love to read while I have coffee in the morning and while I''m eating lunch at work, and because of that I love the origami case that the Voyage has. It''s hard to read the Oasis hands-free, especially if you are used to the Voyage. Also, when reading while laying down, I switch hands unconsciously a couple of times a minute. I didn''t realize this until I used the Oasis, because with the Oasis you have to flip the Kindle over, which may not seem like a big deal, but it definitely does not create a seamless reading experience.So if you like to read while eating or laying down then you are probably better off using the Voyage. If you want the best looking read, then the Oasis is great. And regardless, you are better off reading any Kindle than you are watching the garbage on TV!', 507, 93);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (107, 4, 2925, 'cancelled ATT U-verse and bought this w/ netflix and amazon prime. so far we are very happy - especially kids as they have all their favorite shows/movies', 636, 479);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (108, 1, 3748, 'For the price this Amazon is amazing. Just like the echo but smaller. I show everyone how great it is.', 802, 15);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (109, 1, 4198, 'cancelled ATT U-verse and bought this w/ netflix and amazon prime. so far we are very happy - especially kids as they have all their favorite shows/movies', 921, 94);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (110, 2, 2805, 'This product, while the speaker is great, fails to deliver with a voice interface. Use your cell phone or computer and buy an Echo Dot.', 843, 389);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (111, 3, 7645, 'Has the basics covered: Secure hold, access to all ports, camera etc. Folds flat and holds magnetically if you want to read, but dangles freely if you want to use the camera. Feels secure.Better than expected: Other Kindle cases have been a bit insecure when used as stands, especially in portrait mode. This one is quite secure.Worse than expected: The textured front cover looks fine and feels nice but any slight stain from kids'' food crumbs and the like stains immediately and due to the texturing cannot be wiped off. Even a bristled brush left some noticeable residue on the pale yellow one. Word of advice - unless you are both an OCD neat freak and very careful where you put this thing down, go for a darker color. Expensive - what do you expect for a new captive device', 783, 189);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (137, 2, 2337, 'We live in an RV and we get internet through our phones Hotspot or from free WiFi in RV Parks. Fire TV is sometimes the only way to pick up the TV Shows we have missed. I have not been able to find CBN or The Blaze TV on the device. Those and two of my favorites that I used to watch on the Roku device that I miss.', 385, 421);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (138, 4, 5317, 'Love having someone to take notes for me and play music on demand.', 109, 26);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (139, 1, 7785, 'Alexa works great. It was easy to set-up and to us. My wife uses it for playing music through her iPhone and is very happy with it. I am always finding and learning new things with Alexa.', 517, 390);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (112, 1, 3200, 'First off, I would like to say this tablet is a great deal for just 139.99. I tried finding a tablet for under 100 that would just work properly, and to let you know, it''s impossible. Secondly, I want to tell you how I decided to buy this tablet.I first bought the 9 inch Dragon touch tablet for 78 but to be blunt it sucked. It was so slow that the web browser would always freeze, even if I did a simple Google search. I did not want to take a chance with it anymore and returned it after 2 days of using it then I decided to give the kindle fire HD a chance.Exterior: The exterior is well built. No loose pieces, and the plastic is very firm. My previous cheap tablet had plastic that felt it was going to snap if you held it too hard. Of course the iPad mini has a glass screen and aluminum body, but it also starts at 329. There are 2 ports: a micro usb and a headphone jack to plug in your headphones. The nice thing is that the micro usb is universal and finding a plug is cheap and easy to find. Although, amazon does include a very nice and not cheaply made cable/ wall charger along with your kindle. The previous kindle did not include them and they are worth 20. The buttons for the volume and power are a nice touch. I would not be surprised if new generation tablets will include these style buttons.Only down side is there is no port for an SD card so you can store more memory. It would be a nice feature but if you really need all that storage, go buy a computer.Display: One word, amazing. Maybe I am pushing it, but the screen is so clear. I own an iPhone 5 and my eyes prefer my kindle. I love reading on this machine and for the price, amazon did a good job with this one.Read more', 104, 464);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (113, 2, 4825, 'I purchased this as a Christmas gift for my daughter.She loves it, easy to use, speakers are more clear than her other devices Great volume', 479, 500);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (114, 4, 7390, 'While I''ve purchased items from Amazon for years, I rarely write reviews. I felt compelled to write one because, although there are only a few reviews at this point, I have never seen such a good product get such bad reviews. I''m hoping as more people purchase these, the star rating will be more accurate of the product itself. I''ll address the three biggest complaints I''ve read from others:Sound Quality: I think these headphones sound great. I''ve never owned an expensive pair so I''m not able to compare them to higher-end offerings, but I''ve owned dozens of cheap and mid-range headphones in the 15-50 range. I''m not an audiophile or a musician so if I''m missing something that should be coming through, but isn''t, I''m fine with my ignorance. I would say they''re slightly better than Apple''s buds (which I liked very much and used for years, most recently using their redesigned ones for about a year). There''s no tinny, listening through a can sound that''s all-too-common with headphones in this price range. As far as people saying they don''t compare to Apple''s buds, well I don''t know, maybe they have some crazy exclusive version of Apple''s buds that are amazing. But compared to the regular earpods, I think Amazon''s headphones actually sound a bit better. They provide a nice, full sound and represent highs, lows and mids equally well (mainly listening to metal).Fit and Feel: Some people have complained about these falling, or feeling like they''re going to fall, out of their ears. There''s some validity to this, although obviously it depends on your specific ears. I don''t feel like they''re going to fall out at all, but if I give the cord a tug, they don''t stay as secure as my Apple buds.Read more', 853, 378);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (115, 5, 3295, 'I am not a casual user of on-demand content and devices. Having tried smart tv''s from 3 brands, smart dvd/bluray players, Apple TV, WDTV, HTPC, Chromecast and too many other competing products to mention--for streaming content, before this box you really had two options (for a simple to use box that doesn''t require additional items or tweaking):First is Apple TV which is easy to use (interface) but Apple limits the content you can get greatly (including no Prime Streaming built in) and it lacks a lot in features as well and is slow. The reason for selecting Apple TV is if you have other apple products that unlock features (like Amazon''s content).The second option you could consider was Roku--which really means a Roku 3 box since it is heads and tails better than past Roku boxes in terms of remote and speed. Now Roku stands out with the most content and the most features of any box with the Roku 3. It is for that reason you will see me address the Roku 3 so often in this review.I have added quick summaries of other options to make sure everyone knows about the other options out there.WDTV: Are great for streaming your own content but not very user friendly.Chromecast: Is very cheap at 35 but requires other items to use (no remote included!), is limited to 16 channels according to their own site with other content broadcast via Chrome''s browser not at the same quality level. This does allow you to browse the internet on your tv and is amazing for the cost but is more of a niche market than FireTV/Roku/Apple TV. But if you can live with the short comings, it is worth a look at 1/3 the price of these devices.Smart TVs: Most of these are FINE for occasional use but not nearly as pleasant to use daily like separate boxes.Read more', 387, 200);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (116, 4, 5057, 'Just spent a few hours with my FireTV, and am quite impressed. Setup is incredibly easy, the voice commands work amazingly well, and everything loads quickly. The lack of storage is a major issue if you are planning on using it for gaming. Only 5.6 GB''s of space is usable, which can be filled quite quickly by games that push past 1GB a piece.On the plus side wired xbox 360 controllers workAlso, this would be a great device for someone who is not tech savvy. There is a really nice instructional animation that loads the first time you power on the device, and the voice commands make finding content VERY easy.For parents: There are parental controls, and an option to block all in-app purchases. This is a godsend if you have kids.EDIT: There are dozens of reviews from people who don''t even have a FireTV. Look for the verified purchase logo on reviews. If it doesn''t appear ignore that review as they don''t have any experience with the device.', 300, 348);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (117, 1, 1252, 'Major fan, didn''t buy this because of protection, bought it cause it will blend in to my decor. It is not a skin, so it''s not skin tight. Yes it''s loose but how often will you grab it and move it. Me maybe once every year.', 333, 468);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (163, 1, 2833, 'An Amazon.com official commented on this review(What''s this) The Amazon team saysOctober 11, 2013Thank you for taking the time to share your feedback. We''re excited to see your encouraging comments regarding display and sound, and appreciate the thoughtful analysis you did of this device compared to the previous generation Kindle Fire and Kindle Fire HD. As you correctly point out, the new Kindle Fire HD is the successor to last year''s entry level Kindle Fire, which does not include features such as camera, microphone, or HDMI port. You are also correct to point out that this device does not support Mayday, although there are still multiple ways to get help for free directly from your device. We hope you enjoy the new features and services. Thanks, The Kindle Team', 455, 281);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (118, 3, 1291, 'What a DEAL............ I got this great tablet for a great price on Prime Day..... but was a little concerned it would be too big..to handle. but I was wrong.First I I was very surprised.. by several things about the Fire 10 that made me SMILE:......1) even though it is large in size the weight is LIGHT so it is much easier to handle than expected ( esp since my fire HD 8.9 HEAVY unit )).......2.) it does several things I wasn''t expecting.. One is it has SCREEN MIRRORING... that means you can see your tablets screen on you great BIG TV screen. if you choose for games or what ever. 3. ) Smooth and FAST .. due to the nice processor.......4. ) WHOO HOO.. Google Play store can be easily added without disrupting you Amazon experience ( look it up on youtube))( it took less than 4 minutes and it was Up and RUNNING ))....... 5.) I think the Screen is Beautiful............ ( cannot imagine what others are seeing but this screen looks Great to me) 6.) FINALLY they put the speakers in the FRONT so it is much easier to hear you shows or music etc 7.) I think this is My FAV............I put in a great big 125g sd card and I am loaded to download anything I choose... loads of Movie from the A Amazon Prime Movies,..................ALL of my audio books from Audible.................and a huge amt of my Kindle Books...........I am delighted....... and should get several years out of this tablet in its present format..........ESP. now that google PLAY STORE is on it .Happy Happy Happy......', 643, 485);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (119, 1, 5993, 'Sling is simply awesome and so is the Amazon Tap!! My tap arrived this morning along with this sling and I am currently testing both products out as we speak!! This sling allowed me easy access to carry my tap to work today!!One nice thing I like about the tap is that this sling is not required but it is a very nice addition.. It provides great protection for the tap, which is what I needed it for.. My tap is going to be like a mini, portable Sonos for me.. It''s going to be a speaker I take with me daily!! So I wanted this sling to protect my speaker and keep it from getting dinged up.. Even though it provides minimal coverage for the speaker, it still protects it from dings! The minimal coverage is needed not to hurt the sound quality coming from the speaker... Taking the speaker to the beach, camping, hiking, to parties, I wanted something to protect it while in use!! This sling is going to do just that!!Another thing it does is allows me to hang it from my bag!! At first, I was afraid the silicone wouldn''t be strong enough for that and would stretch.. Well so far, no issues!! I use a carabiner and attach it to my bag!! No stretching and super easy to carry my tap with me!Pros1.) Can access all buttons in the sling2.) Can charge with the sling on (Via USB port not dock)3.) Allows personalization of your Tap4.) Protects your Tap from dings and since my tap isn''t for home use, this is great5.) I love the bright and vibrant colors6.) Silicone is plenty strong enough for hanging7.) Doesn''t adversely affect sound qualityOverall: I do feel 20 for the sling is a little high but for the protection it provides my brand new tap, I very happy with it.. I didn''t buy my tap to sit still at home..Read more', 200, 303);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (120, 5, 6208, 'Bought this on Deal of the Day which surprised me since it is new to Best Buy. Just push the button and ask "her" to do something such as play favorite radio station or music from play list. Have "her" set timers and alarms to wake by. I haven''t used half of the features of TAP. The sound is amazingly great for such a small device.', 638, 442);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (121, 4, 7517, 'I tried 2 other screen protectors that claimed would work with the multiple cameras on the Fire phone, NAH! The Moshi Anti-Glare protector is the only one that lives up to the claim. Money FINALLY well spent.', 161, 42);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (122, 4, 6865, 'An Amazon.com official commented on this review(What''s this) The Amazon team saysJuly 30, 2014Hi Dallas, thank you for sharing your feedback. We wanted to let you know that we made it easier to find your favorite Prime content with the click of your remote. You can now browse many more Prime-only categories, including Top Prime TV, Top Prime Movies, Prime TV for Kids, Prime Movies for Kids, Prime TV by Genre, and Prime Movies by Genre.', 363, 354);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (123, 5, 5900, 'An Amazon.com official commented on this review(What''s this) The Amazon team saysJuly 30, 2014Hi Dallas, thank you for sharing your feedback. We wanted to let you know that we made it easier to find your favorite Prime content with the click of your remote. You can now browse many more Prime-only categories, including Top Prime TV, Top Prime Movies, Prime TV for Kids, Prime Movies for Kids, Prime TV by Genre, and Prime Movies by Genre.', 952, 384);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (124, 5, 2068, 'I am 67 and the only problem I have with my kindle is that it seems to have grafted itself to my hand. I am having trouble putting it down to do things like clean the house, do dishes, wash clothes. It works great and I really love the game plants vs zombies.I love that it came with the wall charger.', 586, 433);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (125, 5, 7907, 'For the low price, this tablet really does more than expected! The camera isn''t great however, I always use my phone for a camera so that doesn''t effect me. Here are some of the pros and cons:Pros: Low cost yet high tech Great screen quality (of course there is better out there, but it looks great as is) Smooth and responsive Easy access to amazon prime content Easy to wirelessly share content to a TV Battery life Web browser works greatCons: Doesn''t have some apps android users are used to having Camera quality isn''t great and no flash Less ''extra features'' than some higher priced tablets haveI opted to go with the 16gb version with no ads. The ads aren''t a big deal, but I figured I would pass on having them on my screen. No matter what version you pick, they all do the same things. The gigs may or may not matter to you. 8 and 16 gigs both aren''t very large, but if you want to predownload some tv shows, movies, music before a vacation, then you may want to look into getting the larger 16gig. If you will always have internet connection, then it isn''t much a problem since you have unlimited cloud storage and can download to your device or stream at anytime you have internet.Overall... If you want an Amazon tablet, and you want the best, go with the HDX series. However, if you want an amazing tablet but don''t want to spend as much, then these new HD 6 7 series are great! For me and my uses, the HD 6 is the perfect fit.I would suggest the 6 over the 7 for most buyers. The only 2 things the 7 has over the 6, are a larger screen, and dual speakers. Sure the dual speakers is kind of nice, but the screen is actually lower quality than the 6.Read more', 634, 398);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (126, 2, 3922, 'Very easy to setup and use. Still learning to maximize the usage. The instructio is too simple and not cover much using Alexa .', 57, 132);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (127, 1, 3474, 'When I purchased the Tap I thought it was a portable speaker for the echo. It''s actually it''s own device. Yes, it''s portable, can operate wireless.It does work with the same "alexa" set up. The Echo operates with no handsyou can simply speak to Alexa. The tap has a microphone button you need to hold down to speak to Alexa. Great sound quality. Rechargeable base unit.', 196, 23);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (128, 5, 7913, 'While I''ve purchased items from Amazon for years, I rarely write reviews. I felt compelled to write one because, although there are only a few reviews at this point, I have never seen such a good product get such bad reviews. I''m hoping as more people purchase these, the star rating will be more accurate of the product itself. I''ll address the three biggest complaints I''ve read from others:Sound Quality: I think these headphones sound great. I''ve never owned an expensive pair so I''m not able to compare them to higher-end offerings, but I''ve owned dozens of cheap and mid-range headphones in the 15-50 range. I''m not an audiophile or a musician so if I''m missing something that should be coming through, but isn''t, I''m fine with my ignorance. I would say they''re slightly better than Apple''s buds (which I liked very much and used for years, most recently using their redesigned ones for about a year). There''s no tinny, listening through a can sound that''s all-too-common with headphones in this price range. As far as people saying they don''t compare to Apple''s buds, well I don''t know, maybe they have some crazy exclusive version of Apple''s buds that are amazing. But compared to the regular earpods, I think Amazon''s headphones actually sound a bit better. They provide a nice, full sound and represent highs, lows and mids equally well (mainly listening to metal).Fit and Feel: Some people have complained about these falling, or feeling like they''re going to fall, out of their ears. There''s some validity to this, although obviously it depends on your specific ears. I don''t feel like they''re going to fall out at all, but if I give the cord a tug, they don''t stay as secure as my Apple buds.Read more', 718, 442);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (129, 1, 7987, 'It''s amazing! I love how loud it plays the music!!', 84, 158);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (130, 1, 1355, 'I can read a lot longer without pain in my hands since the cover holds it for me. Very nice shade of blue.', 536, 119);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (131, 2, 2360, 'It''s pretty good for what it is designed to do: a portable bluetooth speaker and Alexa-enabled speaker. Not voice controlled so you have to touch the speaker button for Alexa. Nice thing once connected to your Alexa account is that you can play music, whatever, without having your phone nearby though Alexa only works when connected to WiFi. If no Wifi, then connect via bluetooth to play music from any apps. Battery life is also pretty good.', 80, 123);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (132, 5, 3460, 'I recommend this speaker Easy to work great sound', 384, 5);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (133, 5, 1233, '(The volume does not work with the iPhones. Please, if you have an iPhone, do your research before buying them, e.g. first line of product description. These work WELL for androids)I wanted to give these headphones a try, so I preordered them at the end of June. They finally came today and I got to try them out.FEEL: They feel like the Apple EarPods headphones when its in your ear. For me, it''s very comfortable. I haven''t had a chance to keep them in all day, but I''ve had them in for 30 minutes to an hour at a time.AUDIO: I''m not a complete audiophile, but I do like the occasional nice set of headphones. If you''re thinking these are a nice set of headphones, then don''t even think about ordering.I guess I would say they''re pretty similar in sound to the EarPods, but I would definitely give these a step up from the apple headphones. Hands down.One thing I did love about the EarPods, was that I could still hear everything around me while I had both headphones in. These are the same way. Some may not like it, but I think it''s perfect for use around the house, at work, or even for working out. I like for the fact I can still hear things going around me. If the ambient noise is too loud, just turn up the volume.I do want to say, that so far, they seem to have good lows and mids. It''s pretty crisp in sound. The bass isn''t too bad either. It''s not like a Skullcandy set of headphones, but the bass IS there (honestly better than I would have expected for these headphones)LOOKS: I love the black look. Tangle free cord is very nice to have, and I also found it interesting how the section above the controls are the regular thin cables to make it lighter when dangling.Read more', 914, 144);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (134, 2, 317, 'If you read my Fire TV review you know that I am tough on Amazon when it comes to their own items. It needs to deliver quality for the price point to earn stars from me. Please take the time to read my entire review and feel free to ask questions. I will do my best to respond to them as I can and update the review to reflect those answers and other things I discover along the way.First my background. I own many Amazon Kindles (bw, Fire gen2, Fire gen3) as well as Apple Ipad (gen 4), Samsung Note 3 and have an LG G2 smartphone (had a Samsung S4 before that), notebooks, chromebooks, etc. I have also used many other products including the Fire HDX line. I have a solid computer background as well but honestly I am more of a casual user when it comes to tablets like this one.Amazon has changed many things over the life of the Fire product line. Adding and removing features (like cameras--the first generation had one but the second generation removed them but not they are back).They are all useful devices but each one has its own niche so to speak so make sure whatever you get has the features that are important to you.Now to this model. This is like a big smartphone--which is a big difference from past kindles. It is more compact, lighter and yet still very usable. In fact for me, the shrinking of size increases the usefulness. I find that I use my smartphone way more than my tablets--even the smaller Fire HD and Samsung Note tablets so I am expecting this to replace more of that on the couch usage which is great since it so much less expensive than most smartphones. That means you can feel less bad about scratches that might occur or the accidental drops. (I am guilty of both.Read more', 97, 254);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (135, 3, 7996, 'I''ll preface this by saying that I own an iPad, and was not expecting a 99 tablet to perform at anywhere near that level. I have followed the early reviews closely, and after seeing enough satisfied customers, I figured I''d give the Kindle Fire HD 6 a try. I chose the base 8 GB with special offers and my plan was to use it as a secondary e-reader and a secondary or even tertiary vehicle for internet access. What I''ve found is a powerful little tablet, so far completely free of the bugs and laggy speeds mentioned in the early reviews. In fact, performance has so exceeded expectations that I consider this perhaps the year''s best purchase.First off the look is nice. It''s sleek, (I ordered the black model) and though actually quite a bit heavier than I''d imagined, it''s not heavy enough to be considered a negative. The display is fantastic, and its quality was the first big surprise. The touch screen performs incredibly well, and to this point, I have experienced immediate response. To the point where I have to say touch response so far is indistinguishable from my iPad. Based on early reviews, this was not the case, so I have been quite pleasantly surprised. The Fire is very user friendly and easy to intuit. For those who do not feel confident with navigation of a new device, there is an immediate onscreen tutorial (with an option to skip) to guide you.I first checked out the e-reader function. My books loaded immediately and easily from the cloud and I really like the functionality of the reader.Read more', 435, 498);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (136, 4, 1825, 'This speaker is great and not only is it a speaker but it''s got the Alexa application!', 902, 339);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (140, 1, 4721, 'I am not a casual user of on-demand content and devices. Having tried smart tv''s from 3 brands, smart dvd/bluray players, Apple TV, WDTV, HTPC, Chromecast and too many other competing products to mention--for streaming content, before this box you really had two options (for a simple to use box that doesn''t require additional items or tweaking):First is Apple TV which is easy to use (interface) but Apple limits the content you can get greatly (including no Prime Streaming built in) and it lacks a lot in features as well and is slow. The reason for selecting Apple TV is if you have other apple products that unlock features (like Amazon''s content).The second option you could consider was Roku--which really means a Roku 3 box since it is heads and tails better than past Roku boxes in terms of remote and speed. Now Roku stands out with the most content and the most features of any box with the Roku 3. It is for that reason you will see me address the Roku 3 so often in this review.I have added quick summaries of other options to make sure everyone knows about the other options out there.WDTV: Are great for streaming your own content but not very user friendly.Chromecast: Is very cheap at 35 but requires other items to use (no remote included!), is limited to 16 channels according to their own site with other content broadcast via Chrome''s browser not at the same quality level. This does allow you to browse the internet on your tv and is amazing for the cost but is more of a niche market than FireTV/Roku/Apple TV. But if you can live with the short comings, it is worth a look at 1/3 the price of these devices.Smart TVs: Most of these are FINE for occasional use but not nearly as pleasant to use daily like separate boxes.Read more', 40, 82);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (141, 5, 242, 'Major fan, didn''t buy this because of protection, bought it cause it will blend in to my decor. It is not a skin, so it''s not skin tight. Yes it''s loose but how often will you grab it and move it. Me maybe once every year.', 189, 245);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (142, 1, 6593, 'Wasn''t sure how this would work with my rural DSL but it is WONDERFUL. I haven''t had any problems with it at all. It is easy to use and the voice command works just as they said it would. So very, very glad I bought it. Loads of stuff to watch. I have been able to catch up with some series I have missed, especially the BBC ones that I dearly love. I recommend it to anyone who likes variety in what they can watch. Along with my Amazon Prime most everything is FREE..that is an added bonus. Try it, you''ll like it.', 106, 258);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (143, 4, 981, 'The Amazon Tap puts out an impressive amount of sound for such a small device. A few things to note if you''re not familiar with the Tap or haven''t seen it in person:- It''s roughly the size of a glass of water- By default, you do have to press the microphone button to talk to Alexa, but as of an update released on Feb 17th, 2017 there is an option in the Alexa app to make the Tap always listen without pushing the button (at the expense of battery life)- The speaker grille is not metal, though it looks like it in pictures. It''s a mesh fabric, similar to what you''d feel on the end of some speaker grilles and micrphones. It''s firm and comfortable to hold, but if you push hard enough it does flex. - Using a sling or other case will most likely not allow you to use the charging dock, as there is very little room between the tap and the dock for any kind of case.- You can charge the Tap using either the included dock or by plugging any micro USB cable (one is included) into the back of the speaker.', 609, 309);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (144, 2, 5415, 'If you do not have WiFi connection, my device says I am connected with excellent score, the airplane mode is off, but still no real connection. Try using the online help with connectionOf course they do not publish a telephone number thus, it is worthless', 879, 87);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (145, 4, 4891, 'First rate - high quality!', 941, 345);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (146, 4, 7424, 'To sum up what I will tell you about in the details below, for 229 you are getting a good deal on a tablet computer - especially if you compare it to the 199 for last year''s first-generation Fire HD and the 500 or more you can spend on a Wi-Fi version of the iPad. Overall, if you consider the price and the functionality I think this is a great tool / toy if you watch a lot of video or play a lot of games on your device: the video quality is outstanding and you can really tell a difference between this and the new HD Fire. If you are a first-time tablet buyer, where price vs. value is a key consideration, or if you are looking for an affordable tablet for the kids, I''d recommend the regular Kindle Fire HD that is only 139. If you''re comparing last year''s HD model to this version and it is operating fine, I''d say save your money and continue to get your money''s worth out of that one.My review below compares a lot of the features of this version of the Fire HDX to the original Fire HD as well as this year''s model of the Fire HD, but also some of the features for a first-time user.Consistent with my experience with setup of this year''s model of the Kindle Fire HD, setup took a long time: despite being a brand new product, the Fire HDX attempted to download and install several operating software updates. Software updates on a Kindle are usually in the background, and it was annoying watching the crashes and manual reboots. Consistent with the Fire HD, it crashed during setup, playing a song, watching a TV show, and reading a book. It took a little over an hour to get this thing up and running without consistent crashes but after the final software update it has worked as expected without further issues.Screen Display / Video Playback:This version of the Fire has the absolute best screen display of any Fire model to date. Looking at the technical specs Amazon made some major changes in the display / resolution, and the picture appears more crisp: I compared the viewing experience watching with my standard test of the Fire devices over the past couple of years - don''t laugh - the first episode of the Wonder Woman TV series from the 70''s. The display on this Fire was one heck of a lot better in terms of sharpness than last year''s model as well as this year''s model of the Fire HD. For you technical folks out there, the display is 1,920 x 1,200 with 50 more pixels per inch than the Fire HD.Wi-Fi Connectivity:The initial Wi-Fi setup took some time as it wouldn''t remember the password for my router after each software update / crash / reboot series. After the final operating software update I mentioned above, however, it was fairly easy to connect to the Internet via Wi-Fi.My standard test for trying out new gadgets is to see how fast they run side-by-side with a known piece of equipment doing the same test at the best place of Wi-Fi in my house and the worst place where it drags. In this comparison, I had this HDX version of the Fire sitting next to last year''s and this year''s version of the HD Fire, as well as last year''s 8.9 HD Fire, Motorola RAZR smartphone, my iPad 2 (yes, the Kindle guy uses an iPad for work), and the first-generation 7 Fire (the model from two years ago) all just using a Wi-Fi connection vs. cellular connectivity.My normal website test is to hit the mobile websites of FoxNews, CNN, my personalized Yahoo page, Google, and the Houston Chronicle. The ones that were usually slow on the other devices were faster on the HDX (Houston Chronicle and CNN), and for the other sites I couldn''t tell a difference in speed at the location closest to my router. When I went to the slowest / worst reception location of my house, the speed did have a noticeable difference in the other devices as this one was a little bit faster than all but last year''s model of the 7 Kindle Fire HD yes, it was also faster than this year''s model of the Fire HD but I attribute the increase in speed to the dual antennas on the HDX.Sound / Music Playback:The two speakers are located in the back of the Kindle Fire in two not-noticeable ports: one on the top and one on the bottom. My test of this feature was cranking up Van Halen''s Panama to maximum volume (I always want to see if it could really play the guitar licks), and I would alternate covering one speaker up over the other: you have true stereo sound with no degradation of the sound that makes you think you are about to blow the speaker. The Dolby speakers sound nice and you do get to hear the bass. However, I am still of the opinion the speakers aren''t going to do very well being placed in the back as I am in the front: I want to be able to hear whatever I am listening to without really having to crank it up and disturbing someone else in the room (that''s what happens when you start losing your hearing like I am). While the cover for this version has not shipped yet - why aren''t the covers released at the same time - I imagine the sound quality might decrease with a cover in the back over the speakers. The X-ray feature is pretty neat as it displays the lyrics on the screen if you are so inclined if you are not, it is as simple as the tap of an icon to make the lyric feature go away.Email Setup:Consistent with previous versions of the Fire, email setup was very easy for my main Gmail account, both with the software came with the Fire but my primary use of an existing app called Enhanced Email I purchased here in the Amazon app store. I did setup the email app that came with the program with no problem - it took about a minute to setup my main Google account - and I was able to send and receive emails as well as synch my online calendar via Google''s calendar and contacts. For those of you asking yourself why am I using the Enhanced Email program, the simple answer is like many of you I have more than one email account: you can quickly switch back and forth on the accounts with the tool. The lazy person in me appreciates that as I don''t like getting out of the lazy chair once I''m settled inNew Tabs and Screen Layout:In addition to the normal tabs Amazon has continued to make tweaks with the look and feel to the overall display such as more things to scroll through to find what you are looking for in an easier manner. Interestingly, and consistent with my experiences with this year''s model of the Fire HD, I purchased the one with special offers and the only ad I have seen so far is on the main screen saver vs. being overwhelmed with ads like last year''s model.Reading Books:Turning pages is pretty darn easy - just tap the side of the screen to go to the next page or back a page, or you can swipe your finger across the screen to do the same. Amazon did add the feature to see the book''s description for books on your device like they have with the e-Ink Kindle (always an annoyance with last year''s model), which is a plus as I can''t remember what each book in my digital to-be-read pile is about getting to the book description, requires several taps on the screen to eventually get to where you want to be. If there is an easier way to do it, I can''t find it and maybe I should be one of the first guys, ever, to crack open the electronic user''s manual to figure it out (doubt it). For those of you who have wondered, you still can''t organize your books into categories unless you purchase a third-party app/a here in the Amazon app store.BluetoothThere is a Bluetooth connection, and I did my usual test of this feature by taking it out to my car and having the Fire stream music through my car stereo. There were no delays or skips with the connection, and it paired up in about a minute. Just make sure you give it a device name so you can recognize it and be recognized.Camera:There is a camera on this model - it faces the front or toward the user / reader. Focusing and taking a picture is pretty easy, and Amazon will by default store your pictures in the Cloud - which counts against your storage allotment. I''d recommend turning that automatic storage feature off unless you are sure you want it, because if you go over the limit that will provide Amazon another opportunity to collect a monthly revenue stream from you.Charger:Unlike previous models of the Fire, this one DOES include a charger If you''re scratching your head with that comment, in previous models you had to purchase a charger separately for 20 which always seemed kind of silly for Amazon to do.Mayday button:A new feature with this model, and not included on this year''s regular model of the Fire, is the introduction of the Mayday button. Basically, you can touch the button and a video screen will pop up and you can actually see - and talk to - a live customer service agent. I haven''t pressed the button yet to try it out, as I think I would feel pretty dumb: when they ask me how can they help, I don''t want to say I just wanted to see if this works and just stopped by to say hi'' for purposes of this review.What I Wish it Had: a case that was ready to go and shipped when the Fire was ready (why are we waiting). A case is very important in order to protect your investment. Also, I''m interested to see how they try to not hurt the speaker''s performance I mentioned above due to the speakers being in the back of the unit and hopefully not covered up with a case.Overall, at 229 for the 16GB of memory model (309 for 64 GB of memory) I think this is a good deal for someone who really uses the video / apps feature. Kids will love it as they can read books, play games, watch TV and movies, and a whole lot of other things. Adults should like it for the exact same reasons, but while I try to minimize the amount of work-related stuff I do at home with the business apps that are available here in the Amazon App store and other places around the Internet I can also work on Excel and Word-compatible files when I have to without having to fire up my work laptop or whatever the case may be. If you''ve never owned a tablet before, or are looking to upgrade from an earlier model Fire, I would recommend this one if video and apps are your thing - but make sure you purchase the higher memory one vs. the minimum 16 GB. If you''re comparing last year''s HD model to this version and it is operating fine, or looking for a tablet for your younger children, I''d say save your money and continue to get your money''s worth out of last year''s model or get this year''s model of the Kindle Fire HD at 139. Read more', 697, 121);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (147, 1, 4158, 'Thank You. Great Product for all ages. Thank You!!', 948, 469);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (148, 1, 6137, 'Great product and really protects the tablet.', 381, 455);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (149, 5, 298, 'Bought my Amazon Fire to take better advantage of Prime video and my wife''s Netflix account. It''s great Easy to set up, the voice search works really well. Love the simplicity and for us it was the perfect way to add streaming media to our main TV.', 393, 350);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (150, 4, 4139, 'This new KFHD replaces last year''s basic Kindle Fire. Although it has some cool new features, it lacks a camera, microphone, and HDMI port. For this reason, I''m glad I kept my 2012 model since it does have these 3 features! Here are my initial impressions of the 2013 Kindle Fire HD: I like the placement of the on/off volume buttons. Being on opposite sides makes it unlikely to hit the wrong one. I never cared for the carousel (this is what you see when you turn your Kindle on and it contains all the books apps you have recently accessed), and now there''s an option to have favorites showing on the home screen instead, and the apps/books can be rearranged to your liking. I was very surprised that web pages can no longer be placed in the favorites bar (which is now being called home). I don''t know why Amazon removed this option, and we also are unable to have the last accessed web page appear in the carousel. But you can still bookmark your favorite web pages YouTube videos for easy access. When I play songs purchased from Amazon''s MP 3 store the lyrics scroll down karaoke style. Nice feature, but it doesn''t work on every song. This device has a cool new feature called Quick Switch, which allows us, when reading or using an app, to bring up recently accessed items with a swipe instead of having to exit the book or app you were using and go back to the home screen to open up another one.In terms of sound, I find it to be tinny and not as rich as it is on the original KFHD. But you can really improve the sound of music by wearing a good set of ear buds. Ironically, music sounds muffled unless you hold the device in landscape mode with your hands covering the speakers. Holding it this way projects the sound out to you.Read more', 189, 256);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (151, 2, 801, 'This item is exactly what I was looking for. It is a perfect size for home or travel. It is very loud for its size.', 708, 137);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (152, 4, 1519, 'This is perfect. A lot of people were commenting that the case falls off and it''s not portable. That''s not the intended use of the case. It is strictly for decorative use. It look great and comes in several color options. Would definitely purchase again.', 264, 285);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (153, 5, 5696, 'I have loved and used my Kindle Keyboard for years now but I missed not being able to read it in a room with low lighting or in the dark. I purchased a Kindle Fire and I also use an iPad 3 but for ease of reading on my eyes I prefer the Kindle Keyboard. I wanted to get a Kindle Paperwhite e-Reader but I held off until this new generation was released before I spent my money. I got this because I wanted to reduce my eyestrain from reading in the evening and I just love this new tablet. It offers the perfect balance of a lit screen with reduced eyestrain and high clarity and contrast of the text.I have added a video of the Kindle Paperwhite compared to a Kindle Keyboard and a Kindle Fire. If you have any questions please feel free to contact me and I will try to answer them.I love that the text on the screen is crisp and clear. I use the Kindle because my declining vision caused me to stop reading books. Reading was my number one hobby my entire life and I just loved it. The Kindle has brought back that reading experience and now with the crisper text and lit screen I can enjoy my reading in every type of environment. I laid my Kindle Keyboard and the New Kindle Paperwhite side by side and the comparison of the quality of text and clarity is amazingly in favor of the new Paperwhite. The new lighting system and screen clarity is where this Paperwhite design really is outstanding. With better contrast, lighting and custom designed fonts, the text just pops out of the screen like you have not seen in an e-Reader before. With 221 PPI (Pixels Per Inch) this screen provides a 768 by 1024 pixel screen that just makes the old Kindle Keyboard look old fashioned. Technology certainly does move quickly on.Read more', 399, 313);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (154, 2, 3242, 'I bought these for a couple of reasons.br /br /First, I wanted an earbud that was NOT designed as noise cancelling. I hate having to shove headphones into my brain to use them. Apparently, a lot of people are under the assumption that these are supposed to be noise cancelling or something which they are not. They are simple earbuds. I hate not being able to hear what is going on around me and don''t feel safe in public using headphones that block everything else out. These are designed just like the old style earbuds that you stick in your ears but they are more comfortable. Maybe I have small ears or something but they could never fall out or dislodge from my ears. They don''t cancel the outside noise but they sit in my ears exactly as they are supposed to so the sound travels right into my ears.br /br /Second, I really like the magnets and tangle free aspects of the headphones. I use headphones while I work and the magnets allow me to hang the headphones easily when I am finished with them. The flat cord and magnets also mean the headphones never really tangle when you put them in a bag or wherever. Awesome design.br /br /Finally, the sound I get out of these seems pretty average. I would compare them to the stock Apple iPhone earbuds or a set of Sony earbuds. Nothing special. They are only 25 and a lot of that is the fact these were just released and that you are paying for the design as far as magnets in the ear buds and the nice flat cable. Don''t expect them to perform like 100 headphones because they aren''t designed to perform like that. They are just a nice simple set of earbuds that will sound good to most people. The magnets and tangle free cord are awesome and they are really quite comfortable.Read more', 950, 7);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (155, 4, 4521, 'Received my new kindle in perfect condition and I am very happy it is faster and a clearer it has a. bigger had drive at a good price and a fast delivery that you can count on you can not go wrongThank you', 567, 255);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (156, 3, 3425, 'This is my 4th Kindle since I bought my first one as soon as Kindle was launched. With every new model, I was fascinated by the improvements and kept recommending them to friends. The Voyager was the first time I felt somewhat frustrated with an Amazon product.Yes, it is lighter and even easier to read than my previous models - if you are buying your first one, don''t hesitate - it is still a great product and still much more comfortable to use than trying to read a book on an iPad - even if it is an iPad Mini.But... There are a few things that I thing Amazon should fix on this one, specially because it is the top of the line Kindle:1. The battery cover just keeps disconnecting from the reader itself. The magnetic attachment is just not strong enough to keep it in position as you manipulate the reader. Previous covers just stayed in place and even the Apple magnetic cover attaches better than this one.2. As you are able to turn off the page buttons on the side, you should be able to turn off page turning on the screen. The way I got used to handle the kindle and as I constantly change hands when I am reading, I get a lot of undesired page turns because I touched the screen somewhere. A very simple fix that could be in one of the next software updates that would greatly improve my perception of the device.3. Battery life (even with the cover) is far from what I expected. My old Kindle had a battery that lasted for more than a month, the new one needs recharging every 15 days.4. The device itself is so light and the battery cover so cumbersome that it should come with a simple,e cover just to protect the screen when you throw it in the bag.5.Read more', 962, 105);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (157, 2, 2194, 'I shopped for a long time until I found this and I am very pleased.', 102, 214);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (158, 1, 6301, 'This is the middle model of the three models that Amazon is shipping this year: the Kindle Fire HD, the Kindle Fire HDX (this tablet), and the Kindle Fire HDX 8.9. This is the successor for last year''s Kindle Fire HD but with an updated operating system and new features, a redesigned shell (with the power and volume control buttons more readily accessible), an absolutely amazing display, superb sound, an included power adapter, and the new Mayday feature.Update: Some users are reporting a bluish glow around the edges of the screen for the HDX. If you search on YouTube for HDX Blue Haze, you can find a video showing the issue. Amazon has updated their Learn More link with the following info:To achieve the perfect color accuracy on Kindle Fire HDX 7 at the lowest possible battery consumption and device weight, we used blue, not white, LEDs. Blue LEDs allow for a much more accurate and rich representation of color and result in an up to 20 improvement in power efficiency.As a result of using these blue LEDs, you may notice a very narrow, faint blue tint around the edge of the device when looking at items with a white background, such as books or web pages. All displays have some level of light emission around the edges, and the light on the Kindle Fire HDX 7 is blue due to the technology used to render perfect color accuracy.If this is something that you think would bother you, I''d recommend taking a look at the YouTube video or taking a look at the HDX at a local Best Buy or office superstore. I''ve also uploaded a user image here of my HDX with a book loaded so that you can see the blue glow (http://www.amazon.com/gp/customer-media/product-gallery/B00DOPNO4M/).Read more', 294, 157);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (159, 5, 2095, 'Speaker is really cool. Sounds great, easy to use. Love the fact that it is portable. Only downside I see from the more expensive model is you have to tap the button (not always listening)', 140, 84);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (160, 2, 1984, 'Camera was perfect for my daughter... she''s in yearbook at school and fell in love with it...', 114, 183);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (161, 4, 3250, 'I bought it for my 15 year old daughter and she loves it. Her friends even loved it so much they went and bought them too.', 942, 68);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (162, 5, 6176, 'Alexa works great and does lots of things for you. Fun for the family.', 2, 287);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (164, 1, 6593, 'I have owned a Kindle for several years now. I have had the 2nd generation Kindle and I have had the Kindle Keyboard. When my mom expressed interest in getting a Kindle I decided to give her my Kindle Keyboard because she doesnt have Wifi in her house and my older Kindle Keyboard had 3G, which is what she needed. And I decided to buy the Basic Kindle for myself because (1) I didnt want to wait for the Paperwhite to come out and (2) I just needed Wifi and (3)and most importantly I JUST WANT TO READ A BOOK, not listen to text-to-speach, or go shopping on Amazon, or listen to music, etc. All I want to do is read a book...thats it! This Kindle is perfect for that. Its smaller and lighter, the pages turn faster than the Keyboard version, it basically has everything I need to download a book and read a book with a much better price than the Paperwhite or Keyboard. Yes, you have to navigate through the keyboard on this kindle with a 5-way controller, but I rarely use the keyboard anyway. To download a book, I just search and buy books on my computer and send them to my Kindle...which is much quicker no matter what version of Kindle you have. So if you dont need, want, or use all the extras then I would definitely recommend the Basic Kindle for 69 with special offers, because who really pays attention to the screen savers anyway.', 371, 412);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (165, 2, 691, 'It''s very easy to connect devices, and it produces a good sound. I''m very pleased with this purchase.', 284, 331);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (166, 5, 7771, '(The volume does not work with the iPhones. Please, if you have an iPhone, do your research before buying them, e.g. first line of product description. These work WELL for androids)I wanted to give these headphones a try, so I preordered them at the end of June. They finally came today and I got to try them out.FEEL: They feel like the Apple EarPods headphones when its in your ear. For me, it''s very comfortable. I haven''t had a chance to keep them in all day, but I''ve had them in for 30 minutes to an hour at a time.AUDIO: I''m not a complete audiophile, but I do like the occasional nice set of headphones. If you''re thinking these are a nice set of headphones, then don''t even think about ordering.I guess I would say they''re pretty similar in sound to the EarPods, but I would definitely give these a step up from the apple headphones. Hands down.One thing I did love about the EarPods, was that I could still hear everything around me while I had both headphones in. These are the same way. Some may not like it, but I think it''s perfect for use around the house, at work, or even for working out. I like for the fact I can still hear things going around me. If the ambient noise is too loud, just turn up the volume.I do want to say, that so far, they seem to have good lows and mids. It''s pretty crisp in sound. The bass isn''t too bad either. It''s not like a Skullcandy set of headphones, but the bass IS there (honestly better than I would have expected for these headphones)LOOKS: I love the black look. Tangle free cord is very nice to have, and I also found it interesting how the section above the controls are the regular thin cables to make it lighter when dangling.Read more', 101, 375);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (167, 5, 2286, 'I''ve owned several different tablets. This one is by far the slowest. And I don''t mean it''s a little slower. I mean you have to wait up to 2 minutes sometimes for the apps to load onto the screen. Opening apps can be quick or take up to 3 minutes. I''ve had far more issues with this Fire than any of the others we''ve owned. If I had realized the difference in speed I would have kept my old one. It''s definitely not work the larger screen. It''s a crap shoot on a daily basis on how fast it will be. But even on it''s fastest day it''s significantly slower than the others.', 184, 259);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (168, 3, 4647, 'What I like is it its sound, it''s portable and I use it at work. The sound fills the whole office.', 497, 77);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (169, 5, 5838, 'While I''ve purchased items from Amazon for years, I rarely write reviews. I felt compelled to write one because, although there are only a few reviews at this point, I have never seen such a good product get such bad reviews. I''m hoping as more people purchase these, the star rating will be more accurate of the product itself. I''ll address the three biggest complaints I''ve read from others:Sound Quality: I think these headphones sound great. I''ve never owned an expensive pair so I''m not able to compare them to higher-end offerings, but I''ve owned dozens of cheap and mid-range headphones in the 15-50 range. I''m not an audiophile or a musician so if I''m missing something that should be coming through, but isn''t, I''m fine with my ignorance. I would say they''re slightly better than Apple''s buds (which I liked very much and used for years, most recently using their redesigned ones for about a year). There''s no tinny, listening through a can sound that''s all-too-common with headphones in this price range. As far as people saying they don''t compare to Apple''s buds, well I don''t know, maybe they have some crazy exclusive version of Apple''s buds that are amazing. But compared to the regular earpods, I think Amazon''s headphones actually sound a bit better. They provide a nice, full sound and represent highs, lows and mids equally well (mainly listening to metal).Fit and Feel: Some people have complained about these falling, or feeling like they''re going to fall, out of their ears. There''s some validity to this, although obviously it depends on your specific ears. I don''t feel like they''re going to fall out at all, but if I give the cord a tug, they don''t stay as secure as my Apple buds.Read more', 625, 107);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (170, 1, 6697, 'As has been the case for years, Amazon sloooowwwwly adds new changes and features to the Kindle. This one is no exception. If you''ve used a Kindle in the past, you''re not going to notice much of a change with this one, but since there are some minor upgrades and so forth, I''ll briefly go over them:*** SCREEN ***The new Kindle is touchscreen and has the typical matte finish with the slightly gray/off-white paper looking background. It''s certainly not bright white, but it''s also not LCD looking (dark gray.) It does NOT have buttons for page-turning as the older generations do. If you simply must have the page-turning buttons, please search for the older Kindles that offer that. One last thing regarding the screen: this is not a Kindle PaperWhite or Voyage where you have a back-lit screen... this has an unlit, off-white Kindle screen. I will say, the text is noticeably crisper and bolder than I''ve seen with previous generation Kindles and I believe that''s because Amazon is using E-Ink''s new Carta displays instead of the previously used Pearl displays. I love that and have been waiting for years for E-Ink, the Taiwan based company that makes the Kindle screens for Amazon, to improve them. It looks like they''re finally getting it!The new Kindle''s screen resolution is 167 ppi which is slightly lower than the Kindle PaperWhite which is 212 ppi, and substantially lower than the Kindle Voyage which boasts an impressive 300 ppi (individual pixels at this density can not be distinguished by the naked eye.) Price-wise though, the base model PaperWhite runs 99 at the time of this review, and the Voyage base model runs 199 so you can see, the more you pay, the better the resolution and features. 167 ppi is fine though...Read more', 438, 211);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (171, 5, 3184, 'Whether you just want the weather, latest sports scores or help with a math problem, Alexa will help. We now have 3 in the house and will be adding two more. With a simple 3 subscription to Amazon''s music service, you can stream almost any music you can think of by simply asking Alexa for it!Perfect work with my meidong QQ Chocolate bluetooth speaker, I also recommend this speaker Meidong Universal Water Resistance QQChocolate Portable V4.0 Wireless Bluetooth Speaker with 10W Dual Driver and Built-in MicrophoneAnd use this code for less 5: GHAQE5YF(I got it from somewhere else.)For the paranoid - this device is NOT for you. The echo dot is always listening and while the design is supposed to only listen when you say the name of the device (Alexa, Amazon or Echo - your choice), there are enough times that I hear one in another room say sorry, I did not understand the question to tell me it misunderstands these prompts to have been said when they weren''t pretty often.+ Good product support+ Good voice recognition+ Because of the size it doesn''t stand out like a sore thumb in a room- Doesn''t differentiate between voices. If you keep it closer to a speaker than you are, then it will sometimes get confused and start picking up words from both the speaker and you when commands are given. Placement of dot is crucial for a good experience.- Only supports english and german for now- Not very competent at answering general questions and you need to activate skills to expand this functionality.Read more', 827, 109);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (172, 3, 2083, '-- function fpresizePlayerSpace(nsPrefix,w,h) try var ifrm parent.document.getElementById(nsPrefix + movieFrameID) if (ifrm) var h2 h + 35 ifrm.style.height h2 catch(err) if (h 0) document.getElementById(nsPrefix + clipDiv).style.heighth+px document.getEl', 400, 451);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (173, 4, 3443, 'A remote this small and black is begging to be lost. I knew it the day we bought it. Somehow my 8 yr old has lost it...someday it will surface but, in the meantime, how do I watch my shows DOWNLOAD THE FIRE TV REMOTE APP. Hey it worked! I have an Apple iPhone 5S and am happy to say the app does indeed work and control my Fire TV stick. Best of all - the app is FREE.', 530, 150);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (174, 4, 6207, 'Pretty cool kids love it. Always adding things to my grocery list I didn''t want.', 1, 364);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (175, 5, 4248, 'For the low price, this tablet really does more than expected! The camera isn''t great however, I always use my phone for a camera so that doesn''t effect me. Here are some of the pros and cons:Pros: Low cost yet high tech Great screen quality (of course there is better out there, but it looks great as is) Smooth and responsive Easy access to amazon prime content Easy to wirelessly share content to a TV Battery life Web browser works greatCons: Doesn''t have some apps android users are used to having Camera quality isn''t great and no flash Less ''extra features'' than some higher priced tablets haveI opted to go with the 16gb version with no ads. The ads aren''t a big deal, but I figured I would pass on having them on my screen. No matter what version you pick, they all do the same things. The gigs may or may not matter to you. 8 and 16 gigs both aren''t very large, but if you want to predownload some tv shows, movies, music before a vacation, then you may want to look into getting the larger 16gig. If you will always have internet connection, then it isn''t much a problem since you have unlimited cloud storage and can download to your device or stream at anytime you have internet.Overall... If you want an Amazon tablet, and you want the best, go with the HDX series. However, if you want an amazing tablet but don''t want to spend as much, then these new HD 6 7 series are great! For me and my uses, the HD 6 is the perfect fit.I would suggest the 6 over the 7 for most buyers. The only 2 things the 7 has over the 6, are a larger screen, and dual speakers. Sure the dual speakers is kind of nice, but the screen is actually lower quality than the 6.Read more', 489, 425);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (176, 5, 7710, 'Must have for people who have an Amazon Prime account and an Echo. Portability and water resistant. Works great by the hot tub or pool, and let''s you access the normal Alexis capabilities.', 461, 221);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (177, 1, 5063, 'My new Kindle Paperwhite came from the USA to a small town in Sweden in just five days. Payment of tax and customs handled by Amazon. Had not the UPS been so square (they think everyone sits at home all day) I had received it a day earlier.I am very pleased with the e-reader, easy on the eyes, and comfortable to hold in one hand. Even if I buy many books from Amazon I also want to read books in the ePub format. A positive surprise was how easy it is to convert ePub format to Amazon''s own format. I use the program Calibre and then I just send the book as an attachment in an e-mail to my Kindle. Quick and easy!', 652, 336);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (178, 4, 1208, 'Like a previous reviewer mentioned it is fabric over hard plastic it is not a snug or tight fit. Good quality though.', 185, 385);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (179, 5, 2539, 'The case that came with my Oasis had an edge that wasn''t quite glued down. Amazon replaced it without difficulty and the new case is flawless.It detaches from the Oasis quickly and easily. I pull the Kindle off when I''m holding it one-handed and pop it right back in when finished.My only complain, which is a minor one, is that the felt inside cover can collect dust and dirt. But I don''t know that there''s a better way to construct it since the interior needs to be soft when it rests against the screen.In any case, it''s a brilliant bit of kit, and I would buy another in an instant were anything to happen to the one I have now.', 414, 279);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (180, 3, 4484, 'I currently own the original echo which is in my living room, a dot in my bedroom, and one at work. I have lights, fans, a thermostat, surround sound, and TV all connected to my Alexa devices. Of course I had to buy one with a screen. I''m a big fan of Alexa, the products have become a routine part of my day. As soon as the Show was available to preorder I ordered one without any hesitation.Initially I wanted to put my show on a 70 inch TV stand by my 60 inch TV where my original Echo was. I figured it wouldn''t look bad because I could use it as a digital picture frame also. I don''t have end tables and quickly came to the realization that viewing a 7 inch screen from 8 feet away wasn''t going to work for me. My Show now sits on my kitchen counter. I figured I''d get more use out of it in my living room because most of my Alexa enabled devices are in there and generally I spend more time in my living room than the kitchen.The problem with displaying the show on a kitchen counter is that the screen can only be seen from straight on if you have a larger kitchen, so if you aren''t standing directly in front of it, it''s hard to view the screen. You will have to turn it in a direction that it would be facing you.As far as I can tell you can not cut the screen off completely, which would make this a bad fit for a bedroom. The clock displays in white with the screen in a dim black by using the command turn off the screen. *Update* The screen can be cut off.This device was marketed as a hands free companion in the kitchen for things like recipes. My frustration is when I ask it to pull up a recipe it''s inconsistent. Sometimes it wants to send the recipe to my phone, sometimes it wants me to swipe down on the screen to access the cooking directions and ingredients.Read more', 507, 181);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (181, 4, 5998, 'For the low price, this tablet really does more than expected! The camera isn''t great however, I always use my phone for a camera so that doesn''t effect me. Here are some of the pros and cons:Pros: Low cost yet high tech Great screen quality (of course there is better out there, but it looks great as is) Smooth and responsive Easy access to amazon prime content Easy to wirelessly share content to a TV Battery life Web browser works greatCons: Doesn''t have some apps android users are used to having Camera quality isn''t great and no flash Less ''extra features'' than some higher priced tablets haveI opted to go with the 16gb version with no ads. The ads aren''t a big deal, but I figured I would pass on having them on my screen. No matter what version you pick, they all do the same things. The gigs may or may not matter to you. 8 and 16 gigs both aren''t very large, but if you want to predownload some tv shows, movies, music before a vacation, then you may want to look into getting the larger 16gig. If you will always have internet connection, then it isn''t much a problem since you have unlimited cloud storage and can download to your device or stream at anytime you have internet.Overall... If you want an Amazon tablet, and you want the best, go with the HDX series. However, if you want an amazing tablet but don''t want to spend as much, then these new HD 6 7 series are great! For me and my uses, the HD 6 is the perfect fit.I would suggest the 6 over the 7 for most buyers. The only 2 things the 7 has over the 6, are a larger screen, and dual speakers. Sure the dual speakers is kind of nice, but the screen is actually lower quality than the 6.Read more', 904, 263);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (182, 3, 3450, 'Update on Dec 23 2013 - Please scroll to the very end of this review for 2 month use update. ...For those who are looking at getting the best tablet out there at the moment, this is the one you should be looking at.My profile: Heavy tablet users for personal and business purposes. I work on my tablet around 4-5 hours a day (Email / Documents / Spreadsheet / PDF ) and use it 1-2 hours for personal use such as watching movies or reading books/magazine. Tablet is my go-to device for all internet related search I do.I have the following and/or used the following before:1) iPad 12) iPad 23) iPad 44) iPad Mini5) Kindle Fire6) Kindle Fire HD7) Kindle Fire HD 8.98) Asus Transformer with Keyboard9) Nexus 7 First Gen10) iPad Air 16gb WifiAs you can see, I been through many devices and hope this review with my experience helps users decide if this is the right device for them. This will be an ongoing review for this device throughout this next year. For comparison sake, I will use last year''s Kindle and iPad mini as they are the closest size to this HDX 7Speed (9/10):This is leaps and bounds faster than last year Kindle HD. Last year Kindle struggles to go through any HD video content I put in. This year''s HDX able to play seamlessly all the HD 1080p contents I added. It is incredible how much the 2.2Ghz quad processor improved vs last year''s model Dual 1.2Ghz.Screen (9/10):This is the biggest improvement over last year''s model. The screen is in true HD 1080p (1920x1080). This means any HD content I throw at it will view in its intended resolution. The screen is crystal clear (much better than iPad mini) and the viewing angle is incredible.Read more', 913, 160);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (183, 4, 1880, 'The Ultimate Bluetooth speaker...I have multiple Amazon Echos and a Whole Echo System set up in my house. I Love Everything Amazon...I can''t stand Apple but now I know how they feel...I am a Cult Member of Amazon!!! LOL So anyway...I have been trashing this device...The Tap...because it does not have the always on feature and that is one of the things I like most about the Echo. The only flaw of the Echo is it is not portable..I tried the Triby but I did not like it...more for little kids. So on Black Friday the Amazon Tap was on super sale so I bought it. The Tap is smaller than I thought it was...about 2/3rd the size of the Echo..which is perfect for portability...But don''t let the size fool you the sound is only short of Bose when it comes to volume and sound quality. Important note...You don''t have to have an Echo to use this device...just The Alexa App on your smart phone. The Tap does everything the Echo does..It is an Amazing Bluetooth speaker...AND IT"S PORTABLE!!! Automatically switches/remembers different WiFi areas and can be used with a Hot Spot. The Most Amazing thing about the Whole Amazon Echo System is that Amazon keeps making enhancements and partnerships weekly. Meaning something it would not do two weeks ago it now does...Some things Even better than Google Now...and Light Years ahead of Siri. The Tap is my new favorite device...it is PERFECT!!! The only flaw is that it IS NOT waterproof...Amazon if you are listening make the next Tap waterproof!!!', 333, 256);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (184, 1, 2628, 'Perfect', 712, 432);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (185, 2, 7044, 'I love the Amazon Fire TV but . . . (I considered giving it only 3 stars for the comments listed below, but I really like it)OK, after only owning the Amazon Fire TV since last Friday, April 4th, I suspected the limited 8GB of internal memory would be a problem and it is.As of last night, April 9th, my Fire TV internal storage was full. I was trying to install the Deus Ex game that is available for Fire TV and received that message that I needed to delete something. So, I started deleting a few games and finally had enough deleted that it started downloading again except I think it started all over again. About 90 of the way through downloading the 2ND TIME, I got the same message to delete some more. So, I deleted a few more games and then it took off downloading again from the beginning again Then, it completed the download and started installing the game and then I got the same message again for a 3RD TIME That made me say a few choice wordsAt that point, I said to heck with it and figured I''d wait to see if Amazon does anything about this. So, I spent 7 on a game I didn''t get to play. See, the USB port isn''t enabled so there is no support for external storage. From what I saw, the Fire TV App takes up 2.2 GB of the total 8GB available. Heck, The Walking Dead app alone is over 1GB in size. I can''t verify this but I swear each time I was downloading Deus Ex it used up another 700+ MB of memory and when the download didn''t complete I didn''t get the storage back So, in (3) attempts to get it installed I swear I used up 2 to 3 GB of internal storage that is still gone. I was looking through all of the apps/games that I have installed and didn''t add it up but I really don''t have that much installed right now and it only looks like it amounts to 2 to 3GB but where the other 2 to 3GB is, is a mystery. I deleted like (8) total games with a couple of them in the 400 to 500MB range and never got Deus Ex installed.Amazon needs to get this fixed fast for anybody that purchased the Fire TV for any sort of Android gaming purposes. Just hope they fix it faster than OUYA did which took like 6 months plus to enable external storage.I would like to add, that it is a huge engineering oversight, in my opinion, to only give the Fire TV 8GB of internal store. Just enable the USB port to allow for external store I would gladly go out and buy a 15 32GB USB memory stick or even spend the 50 to 60 on a 500GB external hard drive.In this day and age, the Fire TV should come with at least 32GB of internal storage That would allow for at least the storage of (60) 500 MB game considering maybe 2GB would be used up for the Amazon Fire TV app. That would be reasonable and fair.Today, 2.2 GB is used for the Fire TV app leaving less than 6GB of internal store. Considering The Walking Dead is over 1GB just by itself, that leaves only 5GB left. What is left only allows for (10) more 500MB games. So, a system that only allows the installation of (10) to (12) games/apps at 500MB each clearly isn''t big enough.', 378, 3);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (186, 5, 7351, 'Update on Dec 23 2013 - Please scroll to the very end of this review for 2 month use update. ...For those who are looking at getting the best tablet out there at the moment, this is the one you should be looking at.My profile: Heavy tablet users for personal and business purposes. I work on my tablet around 4-5 hours a day (Email / Documents / Spreadsheet / PDF ) and use it 1-2 hours for personal use such as watching movies or reading books/magazine. Tablet is my go-to device for all internet related search I do.I have the following and/or used the following before:1) iPad 12) iPad 23) iPad 44) iPad Mini5) Kindle Fire6) Kindle Fire HD7) Kindle Fire HD 8.98) Asus Transformer with Keyboard9) Nexus 7 First Gen10) iPad Air 16gb WifiAs you can see, I been through many devices and hope this review with my experience helps users decide if this is the right device for them. This will be an ongoing review for this device throughout this next year. For comparison sake, I will use last year''s Kindle and iPad mini as they are the closest size to this HDX 7Speed (9/10):This is leaps and bounds faster than last year Kindle HD. Last year Kindle struggles to go through any HD video content I put in. This year''s HDX able to play seamlessly all the HD 1080p contents I added. It is incredible how much the 2.2Ghz quad processor improved vs last year''s model Dual 1.2Ghz.Screen (9/10):This is the biggest improvement over last year''s model. The screen is in true HD 1080p (1920x1080). This means any HD content I throw at it will view in its intended resolution. The screen is crystal clear (much better than iPad mini) and the viewing angle is incredible.Read more', 69, 41);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (187, 1, 5930, 'I''ll preface this by saying that I own an iPad, and was not expecting a 99 tablet to perform at anywhere near that level. I have followed the early reviews closely, and after seeing enough satisfied customers, I figured I''d give the Kindle Fire HD 6 a try. I chose the base 8 GB with special offers and my plan was to use it as a secondary e-reader and a secondary or even tertiary vehicle for internet access. What I''ve found is a powerful little tablet, so far completely free of the bugs and laggy speeds mentioned in the early reviews. In fact, performance has so exceeded expectations that I consider this perhaps the year''s best purchase.First off the look is nice. It''s sleek, (I ordered the black model) and though actually quite a bit heavier than I''d imagined, it''s not heavy enough to be considered a negative. The display is fantastic, and its quality was the first big surprise. The touch screen performs incredibly well, and to this point, I have experienced immediate response. To the point where I have to say touch response so far is indistinguishable from my iPad. Based on early reviews, this was not the case, so I have been quite pleasantly surprised. The Fire is very user friendly and easy to intuit. For those who do not feel confident with navigation of a new device, there is an immediate onscreen tutorial (with an option to skip) to guide you.I first checked out the e-reader function. My books loaded immediately and easily from the cloud and I really like the functionality of the reader.Read more', 866, 478);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (188, 1, 7101, 'I typically don''t post reviews however don''t waste your money on this case. I got it on Friday and started using it that evening. Its now Thursday and the case is peeling at the edges, the fabric around the camera hole has started bubbling, and the felt on the inside edge is wearing off. i have not had any issues with it standing on its own like other people have mentioned. I am giving this a two star mainly because it is still functional. I am tempted to send it back but I like the functionality of this case.', 98, 434);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (189, 2, 994, 'It was time for me to upgrade my Roku 2XS and after looking at the Roku 3 and the Amazon Fire TV I decided to go with the Fire TV. I don''t use a lot of the private channels on Roku and the only thing I saw missing that I have on Roku is Spotify and I''ll work around that. The main reason I decide to go for the Fire TV over the Roku was the gaming feature. I''m not a heavy gamer but having a device that allowed me to play games with a real game pad for only 99 sounded appealing. I''ll break my review into sections so others can quick reference it. I''ll say now this got 2 stars because it is FAST and because, if you don''t mind getting Amazon VOD stuffed down your throat there is some good content.- SETUPInitial boot up was easy, plug in and go and it autoplays a simple intro video. However, I immediately had issues setting up both Plex and Netflix, Netflix still will not work. I get what looks like computer code with the message error forwarding request to origin On Plex and Hulu+ there is a high pitched, metallic echo with all audio and on Hulu+ I occasionally get a pink/lavender screen with audio but no video. Some internet searching suggested this had to do with a handshake issue and that rebooting should fix it, it didn''t. However when I plugged my old Roku back in it worked fine.- NAVIGATION and SEARCH (text and voice)The Fire TV is very, very, very Amazon VOD centered. Most of your navigation data from the main menu pushes you to Amazon movies, TV or apps/games. All other channels reside under the Apps column. As far as I can tell, the voice search only searches Amazon content. This really bothers me as none of the videos, web ads, write ups, etc. mentions this. They brag how they have all your favorite content from Hulu+, Netflix, Crackle, Plex but fail to mention that you cannot search those other apps/channels. BIG turn-off for me. Once inside the other channels navigating and searching works just like the Roku... clicking around with the little remote. The more I think about it the more it annoys me because Amazon advertising made such a big deal out of the voice search and how no one liked clicking around with the remote.- WATCHING TV/MOVIESDon''t know. My audio was too awful to watch anything. Never made it to a single show. I tried changing the settings but that didn''t do any good. EVERY program has a high-pitched echo on it. However it doesn''t have the audio issues when playing games so no idea what the issue is.- PLAYING GAMESTBD. I''ve played a couple games of Asphalt 8 with the remote and it was pretty cool, but a race car game on a remote is a bit tedious. They show out of stock on the Amazon game controller and it looks like they pulled the Nyko due to poor performance. I''d like to get the controller and see what it''s like. If the games are still decent I might swap out the unit and see if that fixes my sound/video issues.- OVERALL IMPRESSIONI do not like the Amazon Fire TV and I''m displeased with Amazon for it. I''ve always trusted Amazon as a company, and they''ve always taken care of me before, but I feel like they pushed a lot of smoke and mirrors to sell this device. I''m torn between trying to get it to work and just returning it and getting a Roku.', 460, 476);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (190, 3, 1129, 'So glad I purchased this productive it use it all the time', 753, 205);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (191, 4, 7139, 'We are HUGE fans of the Amazon Fire Stick and my son realllly wants to play the games with the remote. A little pricey in my opinion. Works great though and I know I can return if it breaks!', 851, 497);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (192, 1, 2855, 'I''ll preface this by saying that I own an iPad, and was not expecting a 99 tablet to perform at anywhere near that level. I have followed the early reviews closely, and after seeing enough satisfied customers, I figured I''d give the Kindle Fire HD 6 a try. I chose the base 8 GB with special offers and my plan was to use it as a secondary e-reader and a secondary or even tertiary vehicle for internet access. What I''ve found is a powerful little tablet, so far completely free of the bugs and laggy speeds mentioned in the early reviews. In fact, performance has so exceeded expectations that I consider this perhaps the year''s best purchase.First off the look is nice. It''s sleek, (I ordered the black model) and though actually quite a bit heavier than I''d imagined, it''s not heavy enough to be considered a negative. The display is fantastic, and its quality was the first big surprise. The touch screen performs incredibly well, and to this point, I have experienced immediate response. To the point where I have to say touch response so far is indistinguishable from my iPad. Based on early reviews, this was not the case, so I have been quite pleasantly surprised. The Fire is very user friendly and easy to intuit. For those who do not feel confident with navigation of a new device, there is an immediate onscreen tutorial (with an option to skip) to guide you.I first checked out the e-reader function. My books loaded immediately and easily from the cloud and I really like the functionality of the reader.Read more', 673, 166);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (193, 5, 7831, 'Besides the missing app functionality (check compatibility before purchasing), it does exactly what I want it to.', 314, 337);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (194, 3, 3453, 'I love everything about this case except for how it fits on the Echo Dot. I was expecting a snug fit however, it is very lose and so you have to make sure that if you pick it up to move it (and the power cable is disconnected), the dot will fall out of the case.', 520, 164);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (195, 2, 6000, 'I replaced the brown suede cover that came with my Kindle because I''d dropped it a couple of times, and it had problems staying connected. It wouldn''t charge so it was pretty much useless. I went with the leather cover because the suede cover, while nice to touch, did get worn(I had one on my old Kindle Paper White), so I decided a leather cover would be better. The color is as lovely as a glass of Merlot and stays connected so far. I love using this new Kindle Oasis because it''s so much lighter than my old Paper White.', 53, 363);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (196, 5, 510, 'This item was very easy to use from the very beginning and was very responsive to my request and commands. I like the fact that you can also add other items to work with it', 527, 49);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (197, 4, 2018, 'I''ve had this Kindle for a while now. Many of the reviews say it all so I don''t think I could add much. But I feel like I need to speak on behalf of this Kindle to shield it from reviewers and owners who seem to have no idea what they bought. If this could help clear up any confusion for a first time buyer then writing this is worth it. So I have to begin by asking reviewers that confuse us allDo you have any clue what you bought Let''s all say it out loud: THIS KINDLE DOES NOT HAVE A LIGHT!!!!!! It is an entry level model with no light. Amazon has always sold non lighted Kindles, and I still have many of them. They are a cheap way to get into the e-reader scene. Can you read a real book in the dark Of course not. So these non lighted Kindles are not epic failures for not having a light just as the last novel you bought was not an epic failure for not having a built in light. It is ridiculous to buy this Kindle then give it a 1 star review because it doesn''t have a light. Read the product descriptions. This Kindle has no light, the Paperwhite and Voyage do.Scream all to the heavens: THIS KINDLE DOES NOT HAVE PAGE TURNING BUTTONS!!!! To buy this Kindle then give it a 1 star review because your old Kindle had page turning buttons and this one does not is insane. Could you not see when you clicked on BUY that this Kindle had no page turning buttons. Sometimes I think there are two kinds of Kindle owners: those who want page turning buttons and those who don''t mind moving their thumb a nano meter to turn a page. If you can tell by my sarcasm, I belong to the latter bunch.Then of course there are the technically deficient that have no clue what wifi is, are unable to sign on, and blame it on the Kindle. BAM! another 1 star review.Read more', 514, 160);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (198, 4, 3240, 'I purchase almost everything with the exception of food from Amazon. I have been a prime member since the inception of the program. Without exception, I have always received EXCELLENT customer service. Until now. I''m having difficulty with my Fire TV connecting to my wifi. Last Saturday I spent approximately 1- hours (maybe 2) troubleshooting with two women techs on the phone. Mary (who I was passed to from the first tech because of her expertise) said she thought it wasn''t just a problem unique to me and asked me if she could call me back on Sunday after researching the problem. I had no problem with that. No call on Sunday so I called on Monday. Much to my surprise, there was no record of my call attached to my file. The rep was confused as to whether I was talking about fire wire or Fire TV so I was first sent to a different department. Finally, I got through that fire wire was not the same as Fire TV and I was transferred back to digital. We went through the same troubleshooting taking up a lot of my time. I was willing to do it until we were going around in circles and my phone was running out of juice. The gentleman asked me if he could research and call me later in the day. NO CALL. It''s Tuesday--still no call.It really pains me to have to say anything negative about Amazon''s Customer Service as it has NEVER BEEN LESS THAN EXCELLENT IN THE PAST. I''ve noticed I haven''t gotten a survey as I usually do after a customer service call. Whoever Amazon has farmed out their digital customer service to will ruin their excellent customer service reputation and they will lose sales because of it. I''m going to wager a bet that there is no record of the 3-4 hours of my time on the phone trying to solve a problem and no record of two promises to call me back. I would have had more respect for these reps if I had received a call saying they were sorry, but they weren''t able to come up with a solution for me.I''m hoping Amazon has kept a record of my past reviews and will review my account and see just how much I''ve spent over the years as a loyal customer. I''m very disappointed that I had to write this review, and I''m hoping someone who can change things reads this and saves Amazon''s reputation. I can''t be the only one receiving this kind of treatment. It''s obvious that the people who are techs for Fire TV are not the same techs that I''ve dealt with in the past. In fact, I don''t think they are even in the same country. What a pity.', 961, 282);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (199, 1, 3484, 'I have a regular echo and now the tap. Both awesome products, use them to control lights, locks, and play music. Would buy again.', 644, 381);
INSERT INTO webshop.review (review_id, review_rating, review_reads, review_text, reviewer, product_id) VALUES (200, 1, 6218, 'Disappointing Kindle.Charging is sometimes interrupted by loss of connection between cover and Kindle. Complained and they sent me another cover. It works better, but still looses connectivity from time to time. Have to stop and disconnect cover and reconnect it. That usually stops the problem for a while.Also, It is not clear from the sales materials that the Premium Leather cover is suede. it shows scratches from fingernails.On the plus side, the Oasis screen is good and the quality of the text is excellent. Lighting is even and reading is easy on this device.', 384, 409);
